(5020, 1, 1, 'NGÂN HÀNG THƯƠNG MẠI CỔ PHẦN CÔNG THƯƠNG VIỆT NAM', 'ngan-hang-thuong-mai-co-phan-cong-thuong-viet-nam', 'company-images/01JCFEY4P30Y53XVGJ8R5M5V6K.jpg', 'image_public_id', 'company-cover-images/01JCFEY4P5B7F21042QVD8HV5V.jpg', 'cover_image_public_id', 'fb-link', 'yt-link', 'ln-link', 'example@co.com', '123456799', 'https://vietinbankgold.vn', '100111948', '2024-09-25', '9', '<h2>Giới thiệu công ty</h2><p>Công Ty TNHH Một Thành Viên Vàng Bạc Đá Quý Ngân Hàng Thương Mại Cổ Phần Công Thương Việt Nam - Chi Nhánh Thành Phố Hồ Chí Minh, được biết đến qua trang web vietinbankgold.vn, chuyên cung cấp các sản phẩm liên quan đến vàng, bạc, đá quý và trang sức cao cấp. Công ty hoạt động với mục tiêu mang đến cho khách hàng những sản phẩm chất lượng và dịch vụ tốt nhất trong lĩnh vực quà tặng và trang sức. Danh mục sản phẩm của công ty bao gồm trang sức kim cương, trang sức cưới, các vật phẩm mạ vàng 24K, cùng với các sản phẩm khác như hộp đựng trà và các món quà tặng độc đáo.<br><br>Công ty cũng chú trọng đến việc cung cấp thông tin về thị trường vàng và kim cương, bao gồm giá vàng và chất lượng kim cương. Điều này giúp khách hàng có được cái nhìn tổng quát cũng như thông tin cần thiết khi đưa ra quyết định mua sắm. Ngoài ra, công ty còn có chính sách tuyển dụng và điều kiện phục vụ dành cho khách hàng, thể hiện sự chuyên nghiệp và nghiêm túc trong công việc.<br><br>Với sự đa dạng trong sản phẩm và dịch vụ, Công Ty TNHH Một Thành Viên Vàng Bạc Đá Quý Ngân Hàng Thương Mại Cổ Phần Công Thương Việt Nam - Chi Nhánh Thành Phố Hồ Chí Minh cam kết không ngừng đổi mới, sáng tạo và nâng cao chất lượng sản phẩm để đáp ứng nhu cầu ngày càng cao của khách hàng.</p><p><br></p>', 10, '2024-09-29 00:50:27', '2024-11-12 05:53:24'),
