(5023, 1, 1, 'CÔNG TY TNHH ĐẦU TƯ VÀ PHÁT TRIỂN ĐÔ THỊ GIA LÂM', 'cong-ty-tnhh-dau-tu-va-phat-trien-do-thi-gia-lam', 'company-images/01JCFFXRJSAFV4M2FRZKX5EMA8.jpg', 'image_public_id', 'company-cover-images/01JCFFXRJWBK0RKRH7D7Y3W589.jpg', 'cover_image_public_id', 'fb-link', 'yt-link', 'ln-link', 'example@co.com', '123456802', 'https://moitruonggialam.com', '106205215', '2024-09-28', '12', '<p>Công ty cổ phần Môi trường đô thị Gia Lâm (tiền thân là Xí nghiệp Môi trường đô thị huyện Gia Lâm) có trụ sở 1 tại số 211 Ngọc Lâm - quận Long Biên - TP Hà Nội, trụ sở 2 tại khu công nghiệp Phú Thị - huyện Gia Lâm - TP Hà Nội. Giấy phép kinh doanh số: 0107490477 do Sở KHĐT Hà Nội cấp ngày 30/6/2016 có đầy đủ ngành nghề, dịch vụ duy trì vệ sinh, duy trì đô thị,...<br>Trong suốt quá trình phát triển từ năm 1994 đến nay, Công ty cổ phần Môi trường đô thị Gia Lâm đã luôn nỗ lực phấn đấu vượt qua những khó khăn thách thức, xây dựng đội ngũ cán bộ công nhân viên, người lao động giỏi chuyên môn, nghiệp vụ; từng bước đầu tư cơ sở vật chất và trang thiết bị hiện đại để đảm nhiệm công tác duy trì vệ sinh, duy trì đô thị trên địa bàn Quận Long Biên, Huyện Gia Lâm, Đường vành đai 3,... Đến nay Công ty cổ phần Môi trường đô thị Gia Lâm đã có hơn 600 CBCNV trong đó có hơn 30 người có trình độ đại học, trên đại học các ngành Xây dựng, Môi trường, Tài chính, Luật, Giao thông,… cùng nhiều trang thiết bị và cơ sở vật chất hiện đại như Nhà máy xử lý rác, Trạm xử lý nước thải, Trạm trung chuyển rác, hơn 50 xe ô tô chuyên dùng các loại (vận chuyển rác, vận chuyển phế thải xây dựng, tưới nước rửa đường, quét hút bụi, hút bể phốt, hút bùn, xe thang điện,...) đủ điều kiện đáp ứng năng lực duy trì vệ sinh, duy trì đô thị trên địa bàn Thành phố Hà Nội.<br>Vì sự nghiệp bảo vệ môi trường và phát triển bền vững của Thủ đô Hà Nội, Công ty cổ phần Môi trường đô thị Gia Lâm mong muốn nhận được sự lãnh đạo chỉ đạo của chính quyền các cấp, sự đồng tình ủng hộ của nhân dân và được hợp tác với các đơn vị, doanh nghiệp trong và ngoài nước vì mục tiêu cùng phát triển.</p>', 100, '2024-09-29 00:50:27', '2024-11-12 06:10:40'),
