(5027, 1, 1, 'NGÂN HÀNG THƯƠNG MẠI CỔ PHẦN SÀI GÒN THƯƠNG TÍN', 'ngan-hang-thuong-mai-co-phan-sai-gon-thuong-tin', 'company-images/01JCFD795K5W4NMR5G87CPV21G.jpg', 'image_public_id', 'company-cover-images/01JCFD795PANXEYX1GQAND8MMB.jpg', 'cover_image_public_id', 'fb-link', 'yt-link', 'ln-link', 'example@co.com', '123456806', 'https://sacombank.com.vn', '301103908', '2024-10-02', '7', '<p>&nbsp;</p><p>Năm 2012, Sacombank có vốn điều lệ là 14.176 tỷ đồng, được coi là ngân hàng thương mại cổ phần có vốn điều lệ và hệ thống chi nhánh lớn nhất Việt Nam.<br>Hiện tại Sacombank kinh doanh trong các lĩnh vực chính sau đây: huy động vốn, tiếp nhận vốn vay trong nước; cho vay, hùn vốn và liên doanh, làm dịch vụ thanh toán giữa các khách hàng; Huy động vốn ngắn hạn, trung hạn, dài hạn của các tổ chức, dân cư dưới các hình thức gửi tiền có kỳ hạn, không kỳ hạn, chứng chỉ tiền gửi, tiếp nhận vốn đầu tư và phát triển của các tổ chức trong nước, vay vốn của các tổ chức tín dụng khác, cho vay ngắn hạn, trung hạn, dài hạn đối với các tổ chức và cá nhân, chiết khấu các thương phiếu, trái phiếu và giấy tờ có giá, hùn vốn và liên doanh theo pháp luật; Làm dịch vụ thanh toán giữa các khách hàng; Kinh doanh vàng bạc, ngoại tệ, thanh toán quốc tế; Huy động vốn từ nước ngoài và các dịch vụ ngân hàng khác trong mối quan hệ với nước ngoài khi được Ngân hàng Nhà nước cho phép.</p><h2>Chính sách bảo hiểm</h2><ul><li>Được hưởng bảo hiểm sức khỏe.</li><li>Được hưởng bảo hiểm xã hội.</li><li>Khi được tuyển dụng trở thành nhân viên của Sacombank các bạn sẽ có cơ hội được đào tạo nhằm hòan thiện các kỹ năng, kiến thức đáp ứng được yêu cầu và thách thức trong công việc. Các khóa đào tạo về chuyên môn và kỹ năng cũng như các buổi tham gia huấn luyện thực tế được chúng tôi tổ chức thường xuyên. Ngoài ra, chương trình Bảo hiểm sức khỏe, hỗ trợ phương tiện đi lại cũng là một trong những phúc lợi nổi bật Sacombank mang đến cho bạn.</li></ul><h2>Các hoạt động ngoại khóa</h2><ul><li>Bóng đá</li><li>Du lịch</li><li>Party</li><li>Tình nguyện</li></ul><h2>Lịch sử thành lập</h2><ul><li>2016: Sacombank hợp tác cùng Resona Bank Ltd., Saitama Resona Bank Ltd và The Kinki Osaka Bank Ltd.,</li><li>2015: Sacombank tổ chức Đại hội đồng cổ đông bất thường 2015 để thông qua Đề án sáp nhập Ngân hàng TMCP Phương Nam (Southern Bank) vào Sacombank.</li><li>2014: Sacombank đã thông qua kế hoạch kinh doanh,chủ trương cho Ngân hàng TMCP Phương Nam sáp nhập vào Sacombank.</li><li>2013: Sacombank đưa vào sử dụng hệ thống Internet Banking phiên bản mới với nhiều tính năng hiện đại và vượt trội.</li><li>2012: Sacombank chính thức tiếp nhận và trở thành ngân hàng TMCP đầu tiên tại Việt Nam áp dụng Hệ thống quản lý trách nhiệm với môi trường và xã hội (ESMS)</li><li>2010: Kết thúc thắng lợi các mục tiêu phát triển giai đoạn 2001 - 2010 với tốc độ tăng trưởng bình quân đạt 64%/năm.</li><li>2005: Thành lập Chi nhánh 8 Tháng 3, là mô hình ngân hàng dành riêng cho phụ nữ đầu tiên tại Việt Nam hoạt động với sứ mệnh vì sự tiến bộ của phụ nữ Việt Nam hiện đại.</li><li>2004: Ký kết hợp đồng triển khai hệ thống Corebanking T_24 với công ty Temenos (Thụy Sĩ) nhằm nâng cao chất lượng hoạt động, quản lý.</li><li>2003: Là ngân hàng đầu tiên được phép thành lập Công ty Liên doanh Quản lý Quỹ đầu tư Chứng khoán Việt Nam (VietFund Management, VFM).</li><li>2002: Thành lập Công ty trực thuộc đầu tiên – Công ty quản lý nợ và Khai thác tài sản Sacombank – SBA, bước đầu thực hiện chiến lược đa dạng hóa các sản phẩm dịch vụ tài chính</li><li>1996: Là ngân hàng đầu tiên phát hành cổ phiếu đại chúng với mệnh giá 200.000 đồng/ cổ phiếu để tăng vốn điều lệ lên 71 tỷ đồng với gần 9.000 cổ đông tham gia góp vốn.</li><li>1993: Ngân hàng TMCP đầu tiên của TP.HCM khai trương Chi nhánh tại Hà Nội.</li><li>1991: Sacombank là một trong những Ngân hàng TMCP đầu tiên được thành lập tại TP.HCM với vốn điều lệ ban đầu là 3 tỷ đồng.</li></ul><p>&nbsp;</p>', 50, '2024-09-29 00:50:27', '2024-11-12 05:26:07'),
(5028, 1, 1, 'CÔNG TY TNHH NHÀ MÁY BIA HEINEKEN VIỆT NAM', 'cong-ty-tnhh-nha-may-bia-heineken-viet-nam', 'company-images/01JCFDT5761Z90476WVSYZGZ9Q.jpg', 'image_public_id', 'company-cover-images/01JCFDT578Y4WPW9QJ3HQPYC1D.jpg', 'cover_image_public_id', 'fb-link', 'yt-link', 'ln-link', 'example@co.com', '123456807', 'https://heineken-vietnam.com.vn', '300831132', '2024-10-03', '3', '<p>Heineken Vietnam Brewery, was established on December 9th, 1991 by Saigon Trading Group (SATRA) and Asia Pacific Breweries Ltd. (APBL) – now Heineken Asia Pacific Pte. Ltd. (HEINEKEN Asia Pacific).<br><br>The brewery covering an area of 12.7 hectares in Thoi An Ward, District 12, HCMC is one of the most modern breweries in Southeast Asia. For a number of years, Heineken Vietnam Brewery has been one of the top corporate tax payers in the city and is recognized as one of the most effective businesses in Ho Chi Minh City. Heineken Vietnam Brewery has also contributed significantly to creating employment opportunities, hiring around 1,600 locals and creating thousands of jobs for suppliers and partners in Vietnam. The company is active in social activities, human resources development and leads the way in environmental protection.<br><br>Apart from the innovative brewery in District 12, Heineken Vietnam Brewery has 100% ownership of breweries in Danang, Quang Nam, Tien Giang and Vung Tau. Currently, Heineken Vietnam Brewery has a broad and impressive portfolio of beers which includes Heineken, Tiger, Tiger Crystal, Desperados, Biere Larue, Biere Larue Export, BGI and Bivina in Vietnam.</p><h2>Vì sao chọn Công Ty TNHH Nhà Máy Bia Heineken Việt Nam</h2><p>Với Heineken Việt Nam, con người luôn là trọng tâm trong mọi hoạt động. Do đó công ty luôn tạo điều kiện để nhân viên \"khai phá tiềm năng\" của mình, ủng hộ tối đa cho những khát vọng của nhân viên và mang đến một môi trường làm việc chủ động, an toàn, hỗ trợ nhân viên không ngừng học tập và phát triển.<br>Ngoài chế độ lương, thưởng cạnh tranh và phù hợp, công ty còn có những chính sách phúc lợi khác như gói chăm sóc sức khỏe cho nhân viên và hỗ trợ cho người thân nhân viên; chế độ nghỉ dưỡng trọn gói cho vợ chồng, con cái; học bổng cho con nhân viên khá giỏi đến bậc đại học và nhiều hoạt động khác mang đến sự cân bằng trong công việc và cuộc sống của nhân viên. Đặc biệt, Heineken Việt Nam còn tạo điều kiện tối đa cho nhân viên phát huy hết tiềm năng của mình qua việc đầu tư vào các chương trình đào tạo và phát triển, giúp họ lĩnh hội được các kỹ năng và kiến thức cần thiết để thăng tiến trong sự nghiệp.<br>Môi trường làm việc của Heineken Việt Nam được dệt nên bởi niềm đam mê, sự sáng tạo và khát vọng thành công tiếp nối từ thế hệ này sang thế hệ khác<br><br></p>', 50, '2024-09-29 00:50:27', '2024-11-12 05:33:45'),
(5029, 36, 1, 'TẬP ĐOÀN BƯU CHÍNH VIỄN THÔNG VIỆT NAM (LOẠI HÌNH DOANH NGHIỆP: CÔNG TY TNHH)', 'tap-doan-buu-chinh-vien-thong-viet-nam-loai-hinh-doanh-nghiep:-cong-ty-tnhh)', 'company-images/01JCFERXQS1TTZ2MVTR8XPR3C1.png', 'image_public_id', 'company-cover-images/01JCFERXQV4Y41KP1AK6CN2MVG.jpg', 'cover_image_public_id', 'fb-link', 'yt-link', 'ln-link', 'example@co.com', '123456808', 'https://vnpt.com.vn/', '100684378', '2024-10-04', '8', '<p>Với những đóng góp và thành tựu đã đạt được trong công cuộc xây dựng chủ nghĩa Xã hội và Bảo vệ Tổ quốc, VNPT đã vinh dự được Chủ tịch nước phong tặng danh hiệu Anh hùng lao động thời kỳ 1999 - 2009 vào ngày 22/12/2009.</p><p>- VNPT vừa là nhà cung cấp dịch vụ đầu tiên đặt nền móng cho sự phát triển của ngành Bưu chính, Viễn thông Việt Nam, vừa là tập đoàn có vai trò chủ chốt trong việc đưa Việt Nam trở thành 1 trong 10 quốc gia có tốc độ phát triển Bưu chính Viễn thông nhanh nhất toàn cầu.</p><p>- Tháng 1/2006, VNPT chính thức trở thành Tập đoàn Bưu chính Viễn thông Việt Nam thay thế cho mô hình Tổng công ty cũ theo quyết định số 06/2006/QĐ-TTg của Thủ tướng Chính phủ, với chiến lược phát triển theo mô hình tập đoàn kinh tế chủ lực của Việt Nam, kinh doanh đa ngành nghề, đa lĩnh vực, đa sở hữu, trong đó Bưu chính - Viễn thông - CNTT là nòng cốt.</p><p>- Ngày 24/6/2010, Công ty mẹ - Tập đoàn Bưu chính Viễn thông Việt Nam chuyển đổi hoạt động sang mô hình Công ty trách nhiệm Hữu hạn một thành viên do Nhà nước làm chủ sở hữu theo quyết định số 955/QĐ-TTg của Thủ tướng Chính phủ.</p><p>- Theo Quyết định số 888/QĐ-TTg ngày 10/6/2014 của Thủ tướng Chính phủ, VNPT đã thực hiện tái cơ cấu tổ chức. Sau khi tái cấu trúc doanh nghiệp, hiện với gần 40 nghìn cán bộ công nhân viên, hạ tầng công nghệ viễn thông tiên tiến, mạng lưới dịch vụ phủ sóng toàn bộ 63 tỉnh thành trên cả nước, VNPT tự hào là nhà cung cấp dịch vụ bưu chính, viễn thông số 1 tại Việt Nam, phục vụ khoảng 30 triệu thuê bao di động, gần 10 triệu thuê bao điện thoại cố định và khoảng hàng chục triệu người sử dụng Internet.</p><p><strong>5. Lĩnh vực kinh doanh:</strong></p><p>- Dịch vụ và sản phẩm viễn thông, công nghệ thông tin và truyền thông đa phương tiện;</p><p>- Khảo sát, tư vấn, thiết kế, lắp đặt, khai thác, bảo dưỡng, sửa chữa, cho thuê các công trình viễn thông, công nghệ thông tin;</p><p>- Nghiên cứu, phát triển, chế tạo, sản xuất thiết bị, sản phẩm viễn thông, công nghệ thông tin;</p><p>- Thương mại, phân phối các sản phẩm thiết bị viễn thông, công nghệ thông tin;</p><p>- Dịch vụ quảng cáo, nghiên cứu thị trường, tổ chức hội nghị hội thảo, triển lãm liên quan đến lĩnh vực viễn thông, công nghệ thông tin;</p><p>- Kinh doanh bất động sản, cho thuê văn phòng;</p><p>- Dịch vụ tài chính trong lĩnh vực viễn thông, công nghệ thông tin và truyền thông đa phương tiện.</p><p><strong>6. Slogan: </strong>VNPT - Cuộc sống đích thực</p>', 50, '2024-09-29 00:50:27', '2024-11-12 05:50:33'),
(5030, 1, 1, 'TỔNG CÔNG TY PHÂN BÓN VÀ HÓA CHẤT DẦU KHÍ - CÔNG TY CỔ PHẦN', 'tong-cong-ty-phan-bon-va-hoa-chat-dau-khi---cong-ty-co-phan', 'company-images/01JCFG9VW900Q6M5Y1G7D27REZ.jpg', 'image_public_id', 'company-cover-images/01JCFG9VWB0W3JNFBPTQ4A0VGT.jpg', 'cover_image_public_id', 'fb-link', 'yt-link', 'ln-link', 'example@co.com', '123456809', 'https://dpm.vn/', '303165480', '2024-10-05', '28', 'Sample description', 50, '2024-09-29 00:50:27', '2024-11-12 06:17:17'),
(5031, 1, 1, 'CÔNG TY CỔ PHẦN ĐẦU TƯ XÂY DỰNG THÁI SƠN', 'cong-ty-co-phan-dau-tu-xay-dung-thai-son', 'company-images/01JCFFAQCRAW30BM56AEPK9D02.png', 'image_public_id', 'company-cover-images/01JCFFAQCVV9ATYPPREFGFSNQR.png', 'cover_image_public_id', 'fb-link', 'yt-link', 'ln-link', 'example@co.com', '123456810', 'https://xaydungthaison.vn/', '305173688', '2024-10-06', '8', '<p>“<strong>Khi Uy Tín và Sự Hoàn Mỹ Gặp Nhau”</strong> có những tác phẩm nổi bật lên không chỉ bởi vẻ ngoài lộng lẫy, mà còn bởi tâm huyết và sự tỉ mỉ trong từng chi tiết. Thái Sơn Construction là doanh nghiệp chuyên thiết kế và thi công xây dựng trọn gói chính là minh chứng sống động cho sự kết hợp này.</p><ul><li>Với nhiều năm kinh nghiệm được tích luỹ và phát triển về chất lượng dịch vụ. Hội tụ những tinh hoa của kiến trúc cổ điển và hiện đại, Thái Sơn Construction tạo nên những không gian sống đẳng cấp. Từng đường cong uốn lượn, từng trụ cột vững chãi, và những hoa văn trang trí tỉ mỉ phản chiếu không gian sống thượng lưu, mang đến cho gia chủ không chỉ là một ngôi nhà mà là cả một di sản để truyền lại.</li></ul>', 10, '2024-09-29 00:50:27', '2024-11-12 06:00:17'),
