(5036, 1, 1, 'NGÂN HÀNG THƯƠNG MẠI CỔ PHẦN PHÁT TRIỂN THÀNH PHỐ HỒ CHÍ MINH', 'ngan-hang-thuong-mai-co-phan-phat-trien-thanh-pho-ho-chi-minh', 'company-images/01JCFGYNN2ZTEW2NKHKDK7CXAG.png', 'image_public_id', 'company-cover-images/01JCFGYNN42BSBREK8D1X7EBG0.png', 'cover_image_public_id', 'fb-link', 'yt-link', 'ln-link', 'example@co.com', '123456815', 'https://hdbank.com.vn', '300608092', '2024-10-11', '7', '<p>Ngân Hàng Thương Mại Cổ Phần Phát Triển Thành Phố Hồ Chí Minh, được biết đến với tên gọi HDBank, là một trong những ngân hàng hàng đầu tại Việt Nam. Chi Nhánh Hà Nội của HDBank cung cấp đa dạng các sản phẩm và dịch vụ ngân hàng nhằm phục vụ khách hàng cá nhân và doanh nghiệp. Ngân hàng cam kết mang đến trải nghiệm dịch vụ thuận tiện với nhiều giải pháp tài chính, từ việc mở tài khoản online miễn phí đến các gửi tiết kiệm với lãi suất cạnh tranh.<br><br>HDBank không ngừng cải tiến các dịch vụ của mình để đáp ứng nhu cầu của khách hàng. Ngân hàng cung cấp nhiều sản phẩm phong phú như tài khoản e-Skyone, dịch vụ cấp tín dụng doanh nghiệp online eCredit, và các chương trình tích điểm thưởng cho khách hàng trung thành. Bên cạnh đó, HDBank cũng chú trọng đến việc tối ưu hóa dịch vụ qua ứng dụng di động, giúp khách hàng thực hiện các giao dịch ngân hàng tiện lợi và nhanh chóng.<br><br>Chi Nhánh Hà Nội của HDBank nằm tại vị trí chiến lược, nhằm phục vụ người dân và doanh nghiệp tại khu vực thủ đô một cách tốt nhất. Đội ngũ nhân viên chuyên nghiệp, tận tình và giàu kinh nghiệm của HDBank cam kết mang đến dịch vụ chất lượng cao, góp phần vào sự phát triển bền vững của ngành ngân hàng tại Việt Nam. Ngân hàng không chỉ tập trung vào phát triển sản phẩm mà còn xây dựng niềm tin và sự hài lòng từ phía khách hàng.</p>', 100, '2024-09-29 00:50:27', '2024-11-12 06:28:39'),
(5037, 1, 1, 'NGÂN HÀNG THƯƠNG MẠI CỔ PHẦN PHƯƠNG ĐÔNG', 'ngan-hang-thuong-mai-co-phan-phuong-dong', 'url-to-image.jpg', 'image_public_id', 'url-to-cover.jpg', 'cover_image_public_id', 'fb-link', 'yt-link', 'ln-link', 'example@co.com', '123456816', 'example.com', '300852005', '2024-10-12', 'Du lịch/Nhà hàng/Khách sạn', 'Sample description', 200, '2024-09-29 00:50:27', '2024-09-29 00:50:27'),
(5038, 1, 1, 'NGÂN HÀNG THƯƠNG MẠI CỔ PHẦN ĐÔNG NAM Á', 'ngan-hang-thuong-mai-co-phan-dong-nam-a', 'company-images/01JCFENXQJW2XXF14HG6B6P8FC.jpg', 'image_public_id', 'company-cover-images/01JCFENXQMDXQZV2RYX8TE8AV4.jpg', 'cover_image_public_id', 'fb-link', 'yt-link', 'ln-link', 'example@co.com', '123456817', 'https://seabank.com.vn', '200253985', '2024-10-13', '7', '<p><strong>Năm 1994<br></strong><br></p><p>Thành lập ngân hàng SeABank.Đây là bước đánh dấu sự phát triển của hệ thống ngân hàng TMCP về sau</p><p><strong>Năm 2005<br></strong><br></p><p>- Thực hiện tái cơ cấu toàn diện hệ thống bằng việc đưa ra các định hướng quan trọng về tài chính, nhân sự, áp dụng công nghệ mới… - Nâng số vốn điều lệ lên 50 tỷ đồng. - Chuyển trụ sở về Hà Nội và mở rộng chi nhánh vào TP.Hồ Chí Minh</p><p><br></p><p><strong>Giai đoạn từ 2001 - 2003<br></strong><br></p><p>Duy trì chất lượng dịch vụ tín dụng tốt, tỷ lệ nợ xấu giữ mức 0,3% trong giai đoạn này.</p><p><br></p><p><strong>Giai đoạn từ 2003 - 2007<br></strong><br></p><p>- Được Nhà nước xếp hạng loại A với tốc độ phát triển nhanh và ổn định. - Thành công đưa phần mềm quản trị lõi ngân hàng T24h – Temenos</p><p><strong>Năm 2018<br></strong><br></p><p>- Mobifone, Tập đoàn Tài chính Ngân hàng Châu Âu Societe Generale (Pháp) trở thành cổ đông chiến lược của SeABank - Ký kết hợp đồng chuyển giao giải pháp công nghệ thẻ Way4 và T24h Temenos - Nâng vốn điều lệ lên 5,068 tỷ đồng</p><p><br></p><p><strong>Năm 2019<br></strong><br></p><p>Trở thành thành viên chính thức của Tổ chức thẻ quốc tế Visa Card và MasterCard.</p><p><br></p><p><strong>Năm 2010<br></strong><br></p><p>Công bố nhận diện thương hiệu mới</p><p><br></p><p><strong>Năm 2011<br></strong><br></p><p>Thành lập văn phòng đại diện tại TP.Hồ Chí Minh, tăng gần 50 điểm giao dịch</p><p><br></p><p><strong>Năm 2012<br></strong><br></p><p>Chính thức đưa và sử dụng Hệ thống dịch vụ Ngân hàng tự động Autobank</p><p><br></p><p><strong>Năm 2013<br></strong><br></p><p>Chính thức được Ngân hàng Nhà nước chấp thuận tăng vốn điều lệ lên 5,466 tỷ đồng</p><p><br></p><p><strong>Năm 2018<br></strong><br></p><p>- Mua lại Công ty Tài chính TNHH MTV Bưu điện (PTF) từ VNPT - Tăng vốn điều lệ lên 7,688 tỷ đồng</p><p><strong>Năm 2019<br></strong><br></p><p>- Tăng vốn điều lệ lên 9,369 tỷ đồng, đáp ứng chuẩn Basel II theo yêu cầu của Ngân hàng Nhà nước. - Hoàn thành việc mua lại trước thời hạn toàn bộ dư nợ đã bán cho VAMC</p><p><br></p><p><strong>Năm 2020<br></strong><br></p><p>- Tăng vốn điều lệ lên 12,087 tỷ đồng. - Sở hữu mạng lưới hơn 170 chi nhánh/phòng giao dịch tại 27 tỉnh thành.</p>', 500, '2024-09-29 00:50:27', '2024-11-12 05:48:55'),
