(5042, 1, 1, 'CÔNG TY CỔ PHẦN CHĂN NUÔI C.P. VIỆT NAM', 'cong-ty-co-phan-chan-nuoi-c.p.-viet-nam', 'company-images/01JCFDYZYEJ0PAN0V0A7M12SQV.png', 'image_public_id', 'company-cover-images/01JCFDYZYHTSWMBKCEHVWR07MQ.jpg', 'cover_image_public_id', 'fb-link', 'yt-link', 'ln-link', 'example@co.com', '123456821', 'https://www.cp.com.vn/', '3600224423', '2024-10-17', '3', '<h2>Giới thiệu công ty</h2><p><br>CÔNG TY CỔ PHẦN CHĂN NUÔI C.P. VIỆT NAM- CHI NHÁNH NHÀ MÁY TIỀN GIANG<br>Tên quốc tế C.P VIET NAM CORPORATION- TIEN GIANG FACTORY BRANCH<br>Tên viết tắt CPV- NM TIỀN GIANG<br>Mã số thuế 3600224423-017<br>Địa chỉ Khu công nghiệp Mỹ Tho, Xã Trung An, Thành phố Mỹ Tho, Tiền Giang<br>Người đại diện Chamnan Wangakkarangkul<br>Ngày hoạt động 2008-09-26<br>Quản lý bởi Cục Thuế Tỉnh Tiền Giang<br>Loại hình DN Công ty cổ phần ngoài NN</p><p><br></p>', 50, '2024-09-29 00:50:27', '2024-11-12 05:36:24'),
(5043, 1, 1, 'CÔNG TY CỔ PHẦN TẬP ĐOÀN ECOPARK', 'cong-ty-co-phan-tap-doan-ecopark', 'company-images/01JCFE24X33KJCJXF7PKN0BRAJ.jpg', 'image_public_id', 'company-cover-images/01JCFE24X5NK7KSPPCAYX0A9MJ.jpg', 'cover_image_public_id', 'fb-link', 'yt-link', 'ln-link', 'example@co.com', '123456822', 'https://ecopark.com.vn', '101395308', '2024-10-18', '3', '<h2>Giới thiệu công ty</h2><p>Thành lập từ năm 2003, Ecopark tiền thân là Công ty Cổ phần đầu tư và phát triển đô thị Việt Hưng (VIHAJICO). Với sứ mệnh xây dựng một khu đô thị sinh thái chức năng đầu tiên ở Việt Nam theo xu hướng phát triển đô thị xanh, hiện đại, VIHAJICO đã xây dựng dự án Khu đô thị Ecopark.<br><br>Sau hơn 18 năm phát triển, Khu đô thị Ecopark đã trở thành một thành phố chức năng kiểu mẫu, tiên phong xác lập xu hướng Bất động sản Xanh với giá cả hợp lý, được quốc tế tôn vinh với nhiều giải thưởng danh giá. Ban lãnh đạo công ty đã quyết định thay đổi tên thành Công ty Cổ phần Tập đoàn Ecopark, hướng tới mục tiêu phát triển bền vững, đầu tư đa ngành vào các lĩnh vực như giáo dục, y tế, nông nghiệp sạch, công nghệ cao, du lịch, vui chơi giải trí…; đồng thời vẫn giữ vững vị thế chủ chốt là Tập đoàn đầu tư và phát triển đô thị chuyên nghiệp theo xu hướng Bất động sản Xanh, mở rộng phát triển mô hình đô thị Ecopark trên địa bàn cả nước.</p><h2>Chính sách bảo hiểm</h2><ul><li>Được hưởng bảo hiểm sức khỏe.</li><li>Được hưởng bảo hiểm xã hội.</li><li>Làm việc trong một môi trường chuyên nghiệp, có tiềm năng phát triển cùng sự phát triển của Công ty. Được hưởng các chế độ phúc lợi của Công ty và quyền lợi khác theo quy định của Bộ Luật Lao động. Cơ hội được đào tạo nâng cao nghiệp vụ chuyên môn. Công ty có xe ô tô đưa đón CBNV</li></ul><h2>Các hoạt động ngoại khóa</h2><ul><li>Bóng đá</li><li>Du lịch</li><li>Câu lạc bộ</li><li>Team building</li><li>Thể thao</li><li>Party</li></ul><h2>Lịch sử thành lập</h2><ul><li>2013: Ecopark nhận giải thưởng Bất động sản quốc tế</li><li>2012: nhận giải thưởng \"Công trình kiến trúc xanh Việt Nam</li><li>2010: Dự án Ecopark đã được khởi công</li><li>2003: Thành lập công ty</li></ul><p><br></p>', 100, '2024-09-29 00:50:27', '2024-11-12 05:38:07'),
(5044, 1, 1, 'TỔNG CÔNG TY CỔ PHẦN BIA - RƯỢU - NƯỚC GIẢI KHÁT SÀI GÒN', 'tong-cong-ty-co-phan-bia---ruou---nuoc-giai-khat-sai-gon', 'company-images/01JCFE5EQ6NFHXQNR5YV85AGF8.jpg', 'image_public_id', 'company-cover-images/01JCFE5EQ9HS1Z910H57R30VVP.jpg', 'cover_image_public_id', 'fb-link', 'yt-link', 'ln-link', 'example@co.com', '123456823', 'https://sabeco.com.vn', '300583659', '2024-10-19', '17', '<h2>Giới thiệu công ty</h2><p>Trong xu thế hội nhập sâu rộng vào nền kinh tế thế giới hiện nay, chiến lược đúng đắn có vai trò quyết định trong sự phát triển và lớn mạnh của doanh nghiệp. Với những nỗ lực phát triển bền bỉ và ổn định, không ngừng nâng cao chất lượng, đa dạng hóa sản phẩm thỏa mãn sự mong đợi của người tiêu dùng, hiện tại – Bia Sài Gòn đang chiếm giữ vị trí dẫn đầu trong ngành Bia VN và 5 lần liên tục vinh dự được công nhận là Thương hiệu Quốc Gia. Bia Sài Gòn cũng đã tự hào trở thành thành viên thứ 351 tại Học viện Bia Berlin – một trong những cái nôi của văn hóa bia toàn cầu.<br>Người tiêu dùng Việt Nam từ lâu đã quen thuộc với thương hiệu Bia Sài Gòn của Tổng Công ty Cổ phần Bia - Rượu - Nước giải khát Sài Gòn. Năm 2017, Bia Sài Gòn đã trải qua 142 năm lịch sử nguồn gốc, 40 năm xây dựng và phát triển thương hiệu. Từ cột mốc 142 năm, dòng chảy vàng óng của Bia đã và sẽ luôn được nỗ lực gìn giữ để tiếp nối dài đến tương lai, luôn tồn tại trong cảm xúc của những người dân Việt tự hào về sản phẩm Việt .<br>Hương vị độc đáo của Bia Sài Gòn là kết tinh sản vật của vùng đất phương Nam trù phú và tinh thần hào sảng phóng khoáng của người Sài Gòn, trở thành một phần không thể thiếu trong cuộc sống vui buồn hàng ngày. Với 2 loại bia chai Larue dung tích 610 ml và bia chai 33 dung tích 330 ml thời kỳ đầu tiếp quản, đến nay , Bia Sài Gòn đã phát triển 8 dòng sản phẩm là bia chai Saigon Lager 450, bia chai Saigon Export, bia chai Saigon Special , bia chai Saigon Lager 355, bia chai 333 Premium, bia lon 333, bia lon Saigon Special, bia lon Saigon Lager góp mặt đầy đủ trên thương trường.</p><p><br></p>', 100, '2024-09-29 00:50:27', '2024-11-12 05:39:55'),
(5045, 1, 1, 'NGÂN HÀNG TRÁCH NHIỆM HỮU HẠN MỘT THÀNH VIÊN HSBC (VIỆT NAM)', 'ngan-hang-trach-nhiem-huu-han-mot-thanh-vien-hsbc-viet-nam)', 'company-images/01JCFE8JCCC5NY3T4FQJJTFRZ0.jpg', 'image_public_id', 'company-cover-images/01JCFE8JCEVN2ZBMRXB71YS0WQ.jpg', 'cover_image_public_id', 'fb-link', 'yt-link', 'ln-link', 'example@co.com', '123456824', 'https://hsbc.com.vn', '301232798', '2024-10-20', '7', '<p>&nbsp;</p><h2>Giới thiệu công ty</h2><p>Ngân hàng HSBC Việt Nam là một thành viên của tập đoàn HSBC toàn cầu, cung cấp các dịch vụ tài chính và ngân hàng đa dạng từ thẻ tín dụng tới các sản phẩm cho vay như vay mua nhà. Ngân hàng này tập trung vào việc phục vụ các nhu cầu tài chính của cả cá nhân và doanh nghiệp. Với một loạt sản phẩm tài chính phong phú, HSBC Việt Nam cam kết mang đến các giải pháp tài chính hiệu quả nhất cho khách hàng.<br><br>Ngân hàng HSBC Việt Nam chú trọng đến an toàn và bảo mật thông tin của khách hàng. Từ ngày 20 tháng 8 năm 2024, HSBC sẽ triển khai biện pháp an toàn mới trên ứng dụng Android nhằm bảo vệ khách hàng trước các phần mềm độc hại. Ngân hàng cung cấp các dịch vụ ngân hàng trực tuyến ưu việt, cho phép khách hàng dễ dàng quản lý tài khoản, thực hiện thanh toán và chuyển khoản nhanh chóng.<br><br>Trong nỗ lực nâng cao trải nghiệm khách hàng, HSBC Việt Nam cũng cung cấp các ưu đãi đặc biệt cho khách hàng sử dụng dịch vụ HSBC Premier. Đơn vị này không chỉ giúp khách hàng tiếp cận với thông tin tài chính mà còn tạo ra các cơ hội đầu tư và tiết kiệm thông minh. Với sự phát triển không ngừng của công nghệ, HSBC Việt Nam cam kết cung cấp dịch vụ năng động và hiệu quả để đáp ứng nhu cầu và mong đợi của khách hàng.</p><h2>Chính sách bảo hiểm</h2><ul><li>Được hưởng bảo hiểm sức khỏe.</li><li>Được hưởng bảo hiểm xã hội.</li></ul><p>&nbsp;</p>', 50, '2024-09-29 00:50:27', '2024-11-12 05:41:37'),
(5046, 1, 1, 'CÔNG TY CỔ PHẦN CHỨNG KHOÁN SSI', 'cong-ty-co-phan-chung-khoan-ssi', 'company-images/01JCFEAWRC6VXFCBGH6TPRTWBY.jpg', 'image_public_id', 'company-cover-images/01JCFEAWRFMSBKA1QA2W4W4J6B.jpg', 'cover_image_public_id', 'fb-link', 'yt-link', 'ln-link', 'example@co.com', '123456825', 'https://ssi.com.vn', '301955155', '2024-10-21', '7', '<h2>Giới thiệu công ty</h2><p>Công ty Cổ phần Chứng khoán Sài Gòn (SSI - HOSE) là định chế tài chính hàng đầu và uy tín trên thị trường Việt Nam. Với tiềm lực tài chính vững mạnh, đội ngũ cán bộ hùng hậu, chuyên nghiệp, SSI luôn cung cấp cho khách hàng các sản phẩm, dịch vụ vượt trội và luôn đảm bảo tối đa lợi ích cổ đông. SSI là công ty chứng khoán có mạng lưới hoạt động rộng tại những thành phố lớn như Hà Nội, TP. Hồ Chí Minh, Hải Phòng, Nha Trang, Vũng Tàu.<br>SSI thu hút được không những sự quan tâm của các nhà đầu tư trong nước, mà còn của nhiều nhà đầu tư nước ngoài danh tiếng. Một số khách hàng tiêu biểu của SSI là Morgan Stanley, HSBC, Vinamilk, Hoàng Anh Gia Lai, Tổng Công ty xăng dầu Việt Nam Petrolimex, Credit Suisse, BIDV, ANZ, Tập đoàn C.T Group, Prudential VN, Deutsche Bank, ...<br>Bên cạnh đó, SSI luôn là cửa ngõ vào thị trường Việt Nam của các nhà đầu tư quốc tế với nhiều họat động kết nối. Đặc biệt, hội nghị Gateway to Vietnam - sự kiện thường niên của SSI luôn là sự kiện tài chính gây tiếng vang lớn trong giới tài chính trong nước, quốc tế, quy tụ đại diện lãnh đạo các doanh nghiệp hàng đầu Việt Nam và hàng trăm nhà đầu tư trong và ngoài nước.<br>Đi cùng với sự phát triển nhanh chóng của hệ thống công nghệ thông tin trong ngành tài chính, SSI cũng đã có những bước chuyển mình cơ bản để nhanh chóng đối mặt với những thách thức, đồng thời đặt nền móng vững chắc cho sự phát triển mạnh mẽ trong tương lai như tái cấu trúc về công nghệ để duy trì hệ thống hạ tầng ổn định, bảo mật, an toàn đáp ứng đầy đủ nhu cầu cho các hoạt động kinh doanh hàng ngày.<br>Nhận thức rất rõ những khó khăn trong thời gian tới, SSI luôn sẵn sàng đối mặt với những thách thức và nắm bắt, hiện thực hóa các cơ hội để công ty tiếp tục phát triển lớn manh.</p><h2>Chính sách bảo hiểm</h2><ul><li>Được hưởng bảo hiểm sức khỏe.</li><li>Được hưởng bảo hiểm xã hội.</li><li>• Chính sách lương minh bạch gắn với sự đóng góp của từng vị trí đối với tổ chức, tương xứng với năng lực nhân viên và tạo tính cạnh tranh so với thị trường • Chính sách phúc lợi toàn diện và thưởng hấp dẫn &amp; cạnh tranh nhất trên thị trường Tham gia các khóa đào tạo, nâng cao kỹ năng theo từng giai đoạn của sự nghiệp • Chính sách tuyển dụng minh bạch với nhiều cơ hội thăng tiến • Hoạt động gắn kết phong phú tạo nên “The great work place” tại SSI</li></ul><h2>Các hoạt động ngoại khóa</h2><ul><li>Bóng đá</li><li>Du lịch</li><li>Team building</li><li>Nghệ thuật</li><li>Party</li><li>Tình nguyện</li></ul><h2>Lịch sử thành lập</h2><ul><li>2016: Bằng khen của UBND TP HCM vì những đóng góp cho lĩnh vực tài chính</li><li>2016: Giải báo cáo thường niên năm 2016; Top 15 công ty chứng khoán tiêu biểu 2015 - 2016</li><li>2016: Top 500 Doanh nghiệp tăng trưởng nhanh nhất Việt Nam; Top 500 Doanh nghiệp lớn Việt Nam</li><li>2016: Top 50 công ty niêm yết tốt nhất 2016; Top 40 thương hiệu giá trị nhất Việt Nam; Top 15 công ty chứng khoán tiêu biểu</li><li>2016: Top 100 Doanh nghiệp phát triển bền vững; Top 1000 Doanh nghiệp nộp thuế thu nhập doanh nghiệp lớn nhất Việt Nam 2016</li><li>2015: Top 50 công ty niêm yết tốt nhất Việt Nam năm 2015 do tạp chí Forbes trao tặng; Nhà môi giới tổ chức tốt nhất Việt Nam</li><li>2015: Top 500 Doanh nghiệp Tư nhân lớn nhất Việt Nam; Công ty quản lý quỹ đầu tư tốt nhất Việt Nam năm 2015 (World Finance)</li><li>2015: Top 10 nhà lãnh đạo doanh nghiệp xuất sắc năm 2015 do tạp chí Nhịp cầu đầu tư bình chọn</li><li>2015: Nhận được bằng khen của Thủ tướng, Bằng khen của Ủy ban nhân dân thành phố Hồ Chí Minh</li><li>2014: Top 50 Công ty niêm yết tốt nhất Việt Namdo tạp chí Forbes trao tặng ; Asiamoney Governance Poll 2014 với 6 giải thưởng</li><li>2014: Công ty môi giới tốt nhất Việt Nam do The Trade Asia trao tặng</li><li>2013: Được vinh danh là thành viên tiêu biểu tại HNX và Top 10 công ty chứng khoán có thị phần môi giới lớn nhất tại HOSE</li><li>2013: Top 500 Doanh nghiệp Tư nhân lớn nhất Việt Nam; Top 1000 Doanh nghiệp nộp thuế thu nhập doanh nghiệp lớn nhất Việt Nam</li><li>2013: Được vinh danh tại Asiamoney Brokers Poll 2013 với 24 giải thưởng danh giá và tại Asia Asset Management Awards</li><li>2012: Nhận được giải thưởng \"Công ty Quản lý Quỹ tốt nhất Việt Nam\"; Thành lập khối Nguồn vốn &amp; Kinh doanh tài chính</li><li>2011: Huân Chương Lao Động Hạng Ba; Đạt được 2 giải thưởng của The Asset: “Ngân hàng Đầu tư tốt nhất” và “Nhà Tư vấn tốt nhất”.</li><li>2010: Được Finance Asia trao giải “Nhà Môi giới tốt nhất Việt Nam”, “Nhà Tư vấn tốt nhất Việt Nam” lần thứ 3 liên tiếp</li><li>2010: Công ty Quản lý Quỹ SSI nhận giải thưởng “Best Vietnam Onshore Fund House” của tạp chí Asian Investor</li><li>2010: Công ty đầu tiên được nhận giải “Ngân hàng Đầu tư tốt nhất Việt Nam”; Top 10 doanh nghiệp tư nhân đóng thuế nhiều nhất</li><li>2009: Được Finance Asia trao giải “Nhà Môi giới tốt nhất Việt Nam” và “Nhà Tư vấn tốt nhất Việt Nam” lần thứ 2 liên tiếp</li><li>2008: Daiwa trở thành cổ đông chiến lược của SSI; Được tạp chí danh tiếng Finance Asia trao giải “Nhà Môi giới tốt nhất Việt Nam”</li><li>2007: Thực hiện thành công đợt IPO cho DPM và đợt chào bán riêng lẻ lớn nhất đối vơi công ty tư nhân cho MPC</li><li>2007: ANZ trở thành cổ đông chiến lược của SSI; Thành lập Công ty Quản lý Quỹ SSI, Công ty TNHH MTV của SSI và Quỹ tầm nhìn SSI</li><li>2006: Thực hiện thành công đợt phát hành trái phiếu chuyển đổi đầu tiên trên TTCKVN cho chính SSI</li><li>2005: Mở rộng hoạt động với 5 nghiệp vụ chính: 4 nghiệp vụ như trước đây và Quản lý danh mục đầu tư chứng khoán</li><li>2002: Thành lập Chi nhánh tại Hà Nội, mở rộng hoạt động kinh doanh ra các tỉnh phía Bắc</li><li>2001: 4 nghiệp vụ chính: Tư vấn Đầu tư chứng khoán, Môi giới Chứng khoán, Tự doanh và Lưu ký Chứng khoán</li><li>1999: SSI được thành lập tại TP. HCM và hoạt động với hai nghiệp vụ: Môi giới Chứng khoán và Tư vấn Đầu tư Chứng khoán</li></ul><p><br></p><p><br><br></p><p><br></p>', 500, '2024-09-29 00:50:27', '2024-11-12 05:42:53'),
(5047, 1, 1, 'NGÂN HÀNG THƯƠNG MẠI CỔ PHẦN XUẤT NHẬP KHẨU VIỆT NAM', 'ngan-hang-thuong-mai-co-phan-xuat-nhap-khau-viet-nam', 'company-images/01JCFEGEYNFG3D17Y4HKPNX2KH.png', 'image_public_id', 'company-cover-images/01JCFEGEYQJQS743PB822PCTTB.jpg', 'cover_image_public_id', 'fb-link', 'yt-link', 'ln-link', 'example@co.com', '123456826', 'https://eximbank.com.vn/', '301179079', '2024-10-22', '7', '<p>NGÂN HÀNG THƯƠNG MẠI CỔ PHẦN XUẤT NHẬP KHẨU VIỆT NAM - CHI NHÁNH HÀ NỘI<br>Mã số thuế 0301179079-002<br>Địa chỉ Số 19 Trần Hưng Đạo, Phường Phan Chu Trinh, Quận Hoàn Kiếm, Thành phố Hà Nội, Việt Nam<br>Người đại diện TRẦN THỊ PHƯƠNG<br>Điện thoại 38242306<br>Ngày hoạt động 1992-10-09<br>Quản lý bởi Cục Thuế Thành phố Hà Nội<br>Loại hình DN Công ty cổ phần ngoài NN<br>Tình trạng Đang hoạt động (đã được cấp GCN ĐKT)</p>', 50, '2024-09-29 00:50:27', '2024-11-12 05:45:56'),
(5048, 1, 1, 'TỔNG CÔNG TY PHÁT ĐIỆN 1', 'tong-cong-ty-phat-dien-1', 'url-to-image.jpg', 'image_public_id', 'url-to-cover.jpg', 'cover_image_public_id', 'fb-link', 'yt-link', 'ln-link', 'example@co.com', '123456827', 'example.com', '5701662152', '2024-10-23', 'Thiết kế đồ họa', 'Sample description', 400, '2024-09-29 00:50:27', '2024-09-29 00:50:27');
INSERT INTO `companies` (`id`, `location_id`, `user_id`, `company_name`, `slug`, `company_image_url`, `company_image_public_id`, `company_cover_image_url`, `company_cover_image_public_id`, `facebook_url`, `youtube_url`, `linkedin_url`, `company_email`, `company_phone`, `website_url`, `tax_code`, `since`, `field_operation`, `description`, `employee_size`, `created_at`, `updated_at`) VALUES
(5049, 1, 1, 'CÔNG TY CỔ PHẦN SÀI GÒN HELIOS', 'cong-ty-co-phan-sai-gon-helios', 'company-images/01JCFH3Q423KSP70J916MRJK0E.jpg', 'image_public_id', 'company-cover-images/01JCFH3Q44HDV7FPKH4BYTRJRF.jpg', 'cover_image_public_id', 'fb-link', 'yt-link', 'ln-link', 'example@co.com', '123456828', 'https://heliospharma.vn', '314464482', '2024-10-24', '3', '<p>&nbsp;</p><h2>Giới thiệu công ty</h2><p>Công Ty TNHH Dược Phẩm Helios là một doanh nghiệp chuyên cung cấp các giải pháp về dược phẩm và mỹ phẩm tại thị trường Việt Nam. Công ty tập trung vào việc nhập khẩu và phân phối các sản phẩm dược phẩm, hoạt chất (APIs), thực phẩm chức năng và mỹ phẩm chất lượng cao. Với niềm tin rằng sức khỏe và sắc đẹp của mỗi người là vô cùng quan trọng, Helios cam kết mang đến những sản phẩm tiện ích, đáp ứng nhu cầu sức khỏe và làm đẹp của khách hàng.<br><br>Ngoài hoạt động nhập khẩu và phân phối, Helios còn cung cấp dịch vụ tư vấn và xúc tiến thương mại. Công ty nỗ lực xây dựng mối quan hệ đối tác bền vững với các nhà sản xuất và nhà phân phối trên toàn thế giới, nhằm mang lại giá trị tốt nhất cho khách hàng. Helios cũng thường xuyên cập nhật thông tin mới nhất về các sản phẩm và chương trình khuyến mãi, tạo điều kiện thuận lợi cho khách hàng trong quy trình mua sắm.<br><br>Văn phòng chính của Công Ty TNHH Dược Phẩm Helios được đặt tại Hồ Chí Minh và Hà Nội, góp phần tạo ra sự tiếp cận dễ dàng và nhanh chóng cho khách hàng. Công ty hoạt động từ thứ Hai đến thứ Sáu, với đội ngũ nhân viên chuyên nghiệp sẵn sàng hỗ trợ về mọi vấn đề liên quan đến sản phẩm và dịch vụ. Helios hướng tới việc tích cực phát triển thị trường dược phẩm và mỹ phẩm, đồng thời cung cấp những sản phẩm an toàn và đáng tin cậy cho sức khỏe và sắc đẹp của người tiêu dùng.</p><h2>Các hoạt động ngoại khóa</h2><ul><li>Du lịch</li><li>Team building</li><li>Thể thao</li><li>Party</li></ul><p>&nbsp;</p>', 100, '2024-09-29 00:50:27', '2024-11-12 06:31:24'),
(5050, 1, 1, 'CÔNG TY TNHH ĐIỆN TỬ SAMSUNG HCMC CE COMPLEX', 'cong-ty-tnhh-dien-tu-samsung-hcmc-ce-complex', 'company-images/01JCF1BG8QPVMQNDXNVX5XFC5Z.png', 'image_public_id', 'company-cover-images/01JCF1BG8STCHVJGFFP5AQCNMF.jpg', 'cover_image_public_id', 'fb-link', 'yt-link', 'ln-link', 'tuyendung@samsumg.com', '+84-2839157310', 'https://www.samsung.com/vn/', '313055543', '2024-10-25', '22', 'Sample description', 1000, '2024-09-29 00:50:27', '2024-11-12 01:56:02'),
(5051, 1, 1, 'NGÂN HÀNG THƯƠNG MẠI CỔ PHẦN HÀNG HẢI VIỆT NAM', 'ngan-hang-thuong-mai-co-phan-hang-hai-viet-nam', 'company-images/01JCFH616APBKA1DTV1M0RH06G.jpg', 'image_public_id', 'company-cover-images/01JCFH616DQREAX71TAEKH4D8R.jpg', 'cover_image_public_id', 'fb-link', 'yt-link', 'ln-link', 'example@co.com', '123456830', 'https://www.msb.com.vn', '200124891', '2024-10-26', '9', '<h2>Giới thiệu công ty</h2><p>Tên quốc tế VIETNAM MARITIME COMMERCIAL JOINT STOCK BANK<br>Tên viết tắt MSB<br>Mã số thuế 0200124891<br>Địa chỉ Số 54A Nguyễn Chí Thanh, Phường Láng Thượng, Quận Đống Đa, Thành phố Hà Nội, Việt Nam<br>Người đại diện Nguyễn Hoàng Linh<br>Ngoài ra Nguyễn Hoàng Linh còn đại diện các doanh nghiệp:<br>NGÂN HÀNG THƯƠNG MẠI CỔ PHẦN HÀNG HẢI VIỆT NAM - CHI NHÁNH ĐỒNG NAI - PHÒNG GIAO DỊCH PHẠM VĂN THUẬN<br>NGÂN HÀNG THƯƠNG MẠI CỔ PHẦN HÀNG HẢI VIỆT NAM - CHI NHÁNH HÀ NỘI - PHÒNG GIAO DỊCH GIANG VĂN MINH<br>NGÂN HÀNG THƯƠNG MẠI CỔ PHẦN HÀNG HẢI VIỆT NAM<br>NGÂN HÀNG THƯƠNG MẠI CỔ PHẦN HÀNG HẢI VIỆT NAM - CHI NHÁNH THANH XUÂN - PHÒNG GIAO DỊCH VĂN QUÁN<br>NGÂN HÀNG THƯƠNG MẠI CỔ PHẦN HÀNG HẢI VIỆT NAM - CHI NHÁNH LONG BIÊN - PHÒNG GIAO DỊCH NGỌC LÂM<br>NGÂN HÀNG THƯƠNG MẠI CỔ PHẦN HÀNG HẢI VIỆT NAM - CHI NHÁNH ĐỒNG NAI - PHÒNG GIAO DỊCH TÂN BIÊN<br>NGÂN HÀNG THƯƠNG MẠI CỔ PHẦN HÀNG HẢI VIỆT NAM - CHI NHÁNH HÀ NỘI - PHÒNG GIAO DỊCH PHỐ CỔ<br>NGÂN HÀNG THƯƠNG MẠI CỔ PHẦN HÀNG HẢI VIỆT NAM - CHI NHÁNH ĐẮK LẮK - QUỸ TIẾT KIỆM TÂN AN<br>NGÂN HÀNG THƯƠNG MẠI CỔ PHẦN HÀNG HẢI VIỆT NAM - CHI NHÁNH THANH XUÂN - QUỸ TIẾT KIỆM XA LA<br>NGÂN HÀNG THƯƠNG MẠI CỔ PHẦN HÀNG HẢI VIỆT NAM - CHI NHÁNH THANH XUÂN - PHÒNG GIAO DỊCH TRUNG YÊN<br>Điện thoại Bị ẩn theo yêu cầu người dùng<br>Ngày hoạt động 2005-07-01<br>Quản lý bởi Cục thuế Doanh nghiệp lớn<br>Loại hình DN Công ty cổ phần ngoài NN<br>Tình trạng Đang hoạt động (đã được cấp GCN ĐKT)</p><p><br></p>', 100, '2024-09-29 00:50:27', '2024-11-12 06:32:40'),
(5052, 1, 1, 'CÔNG TY CỔ PHẦN VINHOMES', 'cong-ty-co-phan-vinhomes', 'company-images/01JCFHCNT8CCZJ6VF0Z4BY171H.jpg', 'image_public_id', 'company-cover-images/01JCFHCNTAGQKKBGPCKE6XJXE5.jpg', 'cover_image_public_id', 'fb-link', 'yt-link', 'ln-link', 'example@co.com', '123456831', 'https://vinhomes.vn', '102671977', '2024-10-27', '3', '<h2>Giới thiệu công ty</h2><p>Vinhomes là đơn vị thành viên nổi bật của VinGroup, tập đoàn đa ngành tập trung vào lĩnh vực bất động sản của Việt Nam. VinGroup được thành lập từ năm 1993 và đã phát triển thành một thương hiệu nổi tiếng, có dấu ấn sâu sắc trong hoạt động đa dạng trên nhiều lĩnh vực như công nghệ, công nghiệp, thương mại, dịch vụ và đặc biệt là bất động sản. Là một tập đoàn chuyên về bất động sản, Vinhomes đã đóng góp rất lớn vào sự lớn mạnh và phát triển của công ty mẹ là Tập đoàn VinGroup.<br><br>Hoạt động chính của Vinhome tập trung vào đầu tư, phát triển và kinh doanh các dự án bất động sản như căn hộ, văn phòng và các tài sản liên quan. Ngoài ra, công ty còn tham gia vào các hoạt động như trang bị cơ sở vật chất, lắp đặt thiết bị, thi công xây dựng, cho thuê máy móc thiết bị và cung cấp các dịch vụ khách sạn, nhà hàng, giải trí.<br><br>Với nền tảng tài chính và quản lý vững mạnh do công ty mẹ VinGroup cung cấp, Vincom đã trở thành một trong những công ty bất động sản hàng đầu Việt Nam với tốc độ tăng trưởng nhanh chóng và chất lượng dịch vụ khách hàng tuyệt vời. Các dự án bất động sản của Vinhome không chỉ mang lại giá trị sống hiện đại cho khách hàng mà còn giúp định hình diện mạo các đô thị Việt Nam và kiến ​​tạo không gian sống xanh, bền vững. Để tiếp tục đà phát triển,Vinhomes tuyển dụng thêm các thành viên bổ sung vào đội ngũ nhân sự của mình được làm việc trong môi trường chuyên nghiệp và quốc tế, hãy gửi CV trên website Jobsgo hoặc Vinhomes tuyển dụng.</p><h2>Chính sách bảo hiểm</h2><ul><li>Được hưởng bảo hiểm sức khỏe.</li><li>Được hưởng bảo hiểm xã hội.</li><li>LƯƠNG THƯỞNG Vinhomes luôn duy trì mức lương cho cán bộ, nhân viên cao hơn so với mặt bằng lương chung của các doanh nghiệp trong cùng lĩnh vực trên thị trường. BẢO HIỂM Việc trích nộp Bảo hiểm xã hội, Bảo hiểm y tế, Bảo hiểm thất nghiệp được thực hiện đầy đủ theo quy định của pháp luật, duy trì chương trình, gói bảo hiểm sức khỏe Bảo Việt dành riêng cho cho cán bộ, nhân viên. ĐÀO TẠO Vinhomes chú trọng đến công tác phát triển nguồn nhân lực thông qua việc triển khai hiệu quả chính sách đào tạo, nâng cao hiểu biết, trình độ nghiệp vụ cho cán bộ, nhân viên, ưu tiên tuyển dụng các vị trí lãnh đạo từ nguồn cán bộ tiềm năng nội bộ. KHEN THƯỞNG Vinhomes luôn có những nhiều chương trình khen thưởng hấp dẫn để tuyên dương và khích lệ cán bộ, nhân viên. SỨC KHỎE Vinhomes luôn đề cao việc chăm sóc sức khỏe cho cán bộ, nhân viên với những chính sách hỗ trợ hấp dẫn tại hệ thống Bệnh viện Đa khoa Quốc tế Vinmec. CÔNG TÁC Trong quá trình làm việc, cán bộ nhân viên của Vinhomes luôn có cơ hội công tác, học tập trong và ngoài nước nhằm phát triển năng lực, networking, cũng như tầm nhìn để phát triển bản thân và bộ phận của mình.</li></ul><h2>Các hoạt động ngoại khóa</h2><ul><li>Bóng đá</li><li>Du lịch</li><li>Team building</li><li>Thể thao</li><li>Party</li><li>Tình nguyện</li></ul><h2>Lịch sử thành lập</h2><ul><li>2015: Mở bán các căn hộ tại dự án Vinhomes Nguyễn Chí Thanh – Hà Nội</li><li>2015: Khởi công công viên Vinhomes Central Park - Công viên ven sông lớn nhất trung tâm TPHCM</li><li>2014: Khởi công khu đô thị hiện đại và cao cấp nhất Việt Nam Vinhomes Central Park</li><li>2013: Thành lập Công Ty TNHH Kinh Doanh Và Quản Lý Bất Động Sản Vinhomes</li><li>2013: Giải thưởng Bất động sản quốc tế - International Property Awards 2013</li></ul><p><br></p>', 50, '2024-09-29 00:50:27', '2024-11-12 06:36:18'),
