(5061, 1, 1, 'Công Ty TNHH Bảo Hiểm Nhân Thọ Prudential Việt Nam', 'cong-ty-tnhh-bao-hiem-nhan-tho-prudential-viet-nam', 'company-images/01JCFJ54BGN0B7W4JFRHKYQ2PX.jpg', 'image_public_id', 'company-cover-images/01JCFJ54BKFX5YQTFJYJJ14STC.jpg', 'cover_image_public_id', 'fb-link', 'yt-link', 'ln-link', 'example@co.com', '123456840', 'https://example.com', '301840443', '2024-11-05', '25', '<p>Prudential Việt Nam tự hào là thành viên của Tập đoàn Prudential, tập đoàn tài chính hàng đầu thế giới được thành lập từ năm 1848, có trụ sở chính tại Vương quốc Anh với bề dày lịch sử kinh doanh, phát triển bền vững, cam kết đầu tư lâu dài, an toàn và hiệu quả.<br><br>Có mặt tại Việt Nam từ năm 1995, Với tuyên ngôn thương hiệu “Lắng nghe. Thấu Hiểu. Hành động.”, Prudential khẳng định cam kết luôn đặt khách hàng làm trọng tâm trong suốt quá trình hoạt động. Prudential có hơn 360 Văn phòng Tổng Đại lý, Văn phòng giao dịch và Trung tâm phục vụ khách hàng tại 63 tỉnh thành, cùng 7 ngân hàng đối tác.<br><br>Prudential là đơn vị bảo hiểm nhân thọ tiên phong ứng dụng công nghệ hiện đại để đơn giản hóa quy trình, nâng cao trải nghiệm khách hàng và hỗ trợ cộng đồng trên hành trình làm chủ sức khỏe cũng như cuộc sống của chính mình.</p><h2>Chính sách bảo hiểm</h2><ul><li>Được hưởng bảo hiểm sức khỏe.</li><li>Kênh Hợp Tác Kinh Doanh tin rằng để gìn giữ vị trí “Role Model” trong ngành Bảo hiểm Nhân thọ tại Việt Nam, việc phát triển một đội ngũ Chuyên Viên Tư Vấn Tài Chính tài năng là vô cùng quan trọng, cần được đầu tư bài bản và lâu dài. Song song với việc phát triển những tài năng trong nội bộ, Kênh Hợp Tác Kinh Doanh cũng chú trọng đến việc tìm kiếm những ứng viên tiềm năng bên ngoài. Chúng tôi đang sở hữu những yếu tố thật sự khác biệt để có thể thu hút những ứng viên tiềm năng: • Lộ trình phát triển sự nghiệp lâu dài và rõ ràng. • Đội ngũ lãnh đạo, quản lý trẻ đầy tài năng và nhiệt huyết. • Môi trường làm việc được trao quyền, ghi nhận, và cơ hội phát triển. • Cân bằng giữa công việc và cuộc sống.</li></ul><h2>Các hoạt động ngoại khóa</h2><ul><li>Du lịch</li><li>Team building</li><li>Party</li></ul><h2>Lịch sử thành lập</h2><ul><li>2015: Lập kỷ lục đầu tư 3.200 tỷ đồng vào trái phiếu chính phủ kỳ hạn 20 năm.</li><li>2009: Công ty BHNT nước ngoài đầu tiên tại Việt Nam có mặt tại tất cả 63 tỉnh thành</li><li>2007: Thành lập Công ty TNHH MTV Tài chính Prudential Việt Nam (Prudential Finance).</li><li>2006: Đạt danh hiệu \"Thương hiệu số một trong ngành Bảo hiểm, Tài chính. Ngân hàng\", đồng thời được bầu chọn vào danh sách \"10 Thương hiệu nổi tiếng nhất Việt Nam\"</li><li>2004: Trở thành công ty BHNT dẫn đầu tại thị trường Việt Nam với thị phần cao nhất</li><li>2002: Thành lập Văn phòng Tổng Đại lý BHNT đầu tiên tại Long An</li><li>1999: Thành lập Công ty Bảo hiểm Nhân thọ Prudential Việt Nam</li><li>1997: Khai trương văn phòng đại diện thứ hai tại thành phố Hồ Chí Minh</li><li>1995: Thành lập VPĐD Công ty Bảo hiểm Nhân thọ Prudential tại Hà Nội</li></ul>', 500, '2024-09-29 00:50:27', '2024-11-12 06:49:39'),
(5062, 1, 1, 'TỔNG CÔNG TY PHÁT ĐIỆN 2 - CÔNG TY CỔ PHẦN', 'tong-cong-ty-phat-dien-2---cong-ty-co-phan', 'url-to-image.jpg', 'image_public_id', 'url-to-cover.jpg', 'cover_image_public_id', 'fb-link', 'yt-link', 'ln-link', 'example@co.com', '123456841', 'example.com', '1800590430', '2024-11-06', 'Marketing/Truyền thông', 'Sample description', 300, '2024-09-29 00:50:27', '2024-09-29 00:50:27'),
(5063, 1, 1, 'CÔNG TY TNHH NƯỚC GIẢI KHÁT SUNTORY PEPSICO VIỆT NAM', 'cong-ty-tnhh-nuoc-giai-khat-suntory-pepsico-viet-nam', 'company-images/01JCFJBH6N8WDB7NJDCSQTEWQM.jpg', 'image_public_id', 'company-cover-images/01JCFJBH6QC0EE8QP36WRK0N82.jpg', 'cover_image_public_id', 'fb-link', 'yt-link', 'ln-link', 'example@co.com', '123456842', 'https://suntorypepsico.vn/', '300816663', '2024-11-07', '17', '<p>&nbsp;</p><h2>Giới thiệu công ty</h2><p>Công ty Nước Giải Khát Suntory PepsiCo Việt Nam (SPVB), 100% vốn nước ngoài, là một liên minh giữa PepsiCo Inc và Suntory Holdings Limited, được chính thức thành lập vào tháng Tư năm 2013. Trụ sở chính nằm trên Tầng 5, Khách sạn Sheraton, 88 Đồng Khởi, Quận 1, Thành phố Hồ Chí Minh. Nhiệm vụ và tầm nhìn của công ty là tiếp tục củng cố và duy trì vị trí hàng đầu trong ngành công nghiệp nước giải khát trong khi vẫn sống với các giá trị của công ty. Trong tương lai, chúng tôi sẽ tiếp tục theo đuổi mục tiêu phát triển bền vững, mang lại lợi ích cho nhân viên công ty và các đối tác kinh doanh, cũng như đóng góp cho cộng đồng nơi công ty hoạt động kinh doanh.</p><h2>Chính sách bảo hiểm</h2><ul><li>Được hưởng bảo hiểm sức khỏe.</li><li>Được hưởng bảo hiểm xã hội.</li><li>- Bảo hiểm sức khỏe do công ty cấp - Bữa ăn theo ca tại căn-tin, bữa ăn dinh dưỡng, sữa. - Công Đoàn - 20 ngày phép - Nghỉ mát cùng công ty 01 lần/năm</li></ul><h2>Các hoạt động ngoại khóa</h2><ul><li>Du lịch</li><li>Team building</li><li>Thể thao</li><li>Party</li></ul><h2>Lịch sử thành lập</h2><ul><li>2013: Liên minh nước giải khát chiến lược Suntory PepsiCo Việt Nam đã được thành lập giữa Suntory Holdings Limited và PepsiCo, Inc</li><li>2010: PepsiCo tuyên bố tiếp tục đầu tư vào Việt Nam 250 triệu USD cho ba năm tiếp theo</li><li>2005: Chính thức trở thành một trong những công ty về nước giải khát lớn nhất Việt Nam</li><li>2003: Công ty được đổi tên thành Công ty Nước Giải khát Quốc tế PepsiCo Việt Nam</li><li>1994: PepsiCo chính thức gia nhập thị trường Việt Nam khi liên doanh với công ty Nước giải khát Quốc tế IBC</li><li>1991: Công ty Nước giải khát Quốc tế (IBC) được thành lập do liên doanh giữa SP. Co và Marcondray - Singapore</li></ul><p>&nbsp;</p>', 500, '2024-09-29 00:50:27', '2024-11-12 06:53:09'),
(5064, 1, 1, 'SỞ GIAO DỊCH CHỨNG KHOÁN THÀNH PHỐ HỒ CHÍ MINH', 'so-giao-dich-chung-khoan-thanh-pho-ho-chi-minh', 'company-images/01JCFJEM5XBAXE11JWY518ZQGP.jpg', 'image_public_id', 'company-cover-images/01JCFJEM5Z5PAYJ4K1C7VB53K4.jpg', 'cover_image_public_id', 'fb-link', 'yt-link', 'ln-link', 'example@co.com', '123456843', 'https://hsx.vn', '302270531', '2024-11-08', '26', '<p>Sở Giao Dịch Chứng Khoán Thành Phố Hồ Chí Minh (HOSE) là một trong những sàn giao dịch chứng khoán quan trọng tại Việt Nam, đóng vai trò chủ chốt trong việc phát triển thị trường chứng khoán trong nước. Tổ chức này cung cấp một môi trường lái thuyền cho các hoạt động giao dịch chứng khoán, giúp các nhà đầu tư và tổ chức tài chính mẹo kết nối để thực hiện giao dịch mua bán cổ phiếu và các sản phẩm tài chính khác.<br><br>HOSE không chỉ dừng lại ở việc thực hiện các giao dịch, mà còn tích cực tham gia vào các hoạt động phát triển bền vững và quản trị công ty. Với các dịch vụ và sản phẩm đa dạng, HOSE cung cấp các bộ chỉ số đầu tư và thông tin tổng hợp về tình hình thị trường, cũng như nghiên cứu môi trường và xã hội trong lĩnh vực tài chính. Các báo cáo về tình hình hoạt động của các công ty niêm yết và tổ chức thành viên được cập nhật đầy đủ, giúp các nhà đầu tư có cái nhìn tổng quan về thị trường.<br><br>Ngoài ra, HOSE cũng chú trọng vào công tác quản lý và giám sát thị trường, đảm bảo tính minh bạch và công bằng trong các giao dịch. Các thông tin về các vi phạm và nhắc nhở vi phạm được công bố công khai theo quy định, góp phần tăng cường lòng tin của nhà đầu tư và thúc đẩy sự phát triển ổn định của thị trường chứng khoán Việt Nam.</p>', 500, '2024-09-29 00:50:27', '2024-11-12 06:54:50'),
(5065, 1, 1, 'CÔNG TY CỔ PHẦN VÀNG BẠC ĐÁ QUÝ PHÚ NHUẬN', 'cong-ty-co-phan-vang-bac-da-quy-phu-nhuan', 'company-images/01JCFJJXQB1W0SMFZAW37ZDNQ3.jpg', 'image_public_id', 'company-cover-images/01JCFJJXQE2CKNYPR5C9T8ZQHH.jpg', 'cover_image_public_id', 'fb-link', 'yt-link', 'ln-link', 'example@co.com', '123456844', 'https://pnj.com.vn', '300521758', '2024-11-09', '3', '<p>PNJ là thương hiệu hàng đầu tại Việt Nam trong lĩnh vực chế tác và bán lẻ trang sức bằng vàng, bạc, đá quý. Sản phẩm PNJ ngày càng được các nước tại thị trường Châu Á và Châu u ưa chuộng. Không chỉ thế, PNJ còn một trong những doanh nghiệp đón bắt và ứng biến kịp thời tốc độ thay đổi nhanh chóng của thị trường.<br><br>Từ những năm 2017, PNJ đã thực thi nhiều chiến lược tái cấu trúc công ty. Doanh nghiệp đã tuần tự nhấn nút “F5 - Refresh” ở các phòng ban, đặc biệt và trước nhất là Khối Nguồn nhân lực với chiến lược đổi mới mô hình quản trị nhân sự sáng tạo.<br><br>Các chiến lược nhân sự được tích hợp vào chiến lược phát triển tổng thể của công ty. Bằng cách áp dụng các chiến lược đổi mới mô hình quản trị nhân sự, phát triển năng lực tổ chức và nâng cao chất lượng nguồn nhân lực, PNJ đã gia tăng năng lực triển khai mô hình kinh doanh cũng như trải nghiệm khách hàng.<br>PNJ đã thực hóa bằng nhiều chương trình thúc đẩy nhân sự đổi mới tư duy, vượt qua giới hạn công việc và gia tăng giá trị cho doanh nghiệp. Cụ thể, PNJ đã tận dụng những cơ hội tăng trưởng và vượt lên quá trình tăng trưởng tự thân nhờ thử nghiệm các mô hình kinh doanh mới. Song song đó, doanh nghiệp cũng dùng mô hình này làm nền tảng chuyển hóa công ty thành hệ sinh thái đa kinh doanh với tầm nhìn hướng tới năm 2027.<br>Không dừng lại ở đó, PNJ luôn nỗ lực kiến tạo môi trường làm việc hạnh phúc toàn diện, chính sách phúc lợi, chiến lược nhân sự đổi mới, phát triển đội ngũ người lao động chất lượng cao, hướng tới phát triển bền vững. Đây là “quả ngọt” của quá trình bền bỉ “F5-Refresh” tái cấu trúc tổ chức một cách quyết liệt và mạnh mẽ trong thời gian qua.<br><br>Với những nỗ lực không ngừng nghỉ, PNJ đã đạt được nhiều thành tựu đáng kể: Top 100 Môi trường làm việc tốt nhất Việt Nam, Thương hiệu nhà tuyển dụng yêu thích,... trong nhiều năm qua.<br>Để thực hiện được điều đó, doanh nghiệp PNJ liên tục tuyển dụng để cấy tạo những nguồn \"DNA\" mới mẻ, sáng tạo, cải tiến công nghệ để tạo nên động cơ mạnh mẽ thúc đẩy con thuyền PNJ bứt phá vươn ra biển lớn, lập đỉnh tăng trưởng. Hơn 7.000 con người tại PNJ cùng chung hệ giá trị, tầm nhìn và sứ mệnh để phụng sự khách hàng và xã hội. Để tiếp tục đà phát triển PNJ tuyển dụng thêm các ứng viên với tinh thần trách nhiệm cao được đào tạo trong môi trường chuyên nghiệp và bài bản.</p><h2>Chính sách bảo hiểm</h2><ul><li>Được hưởng bảo hiểm sức khỏe.</li><li>Được hưởng bảo hiểm xã hội.</li><li>Thu nhập cạnh tranh. Tham gia các chương trình Đào tạo phát triển kỹ năng, chuyên môn. Cơ hội phát triển nghề nghiệp (Career Path) cho từng cấp vị trí. Tham gia các loại Bảo hiểm: BH 24/24, BH sức khỏe Premium HealthCare tùy vào cấp bậc. Tham gia kiểm tra sức khỏe định kỳ hàng năm.</li></ul><h2>Các hoạt động ngoại khóa</h2><ul><li>Bóng đá</li><li>Du lịch</li><li>Team building</li></ul><h2>Lịch sử thành lập</h2><ul><li>2012: Tái cấu trúc để phát triển trường tồn từ năm 2012 đến 2017</li><li>2009: Thành lập Công ty TNHH MTV Thời trang CAO cùng với việc bổ sung ngành kinh doanh đồng hồ của các nhãn hiệu nổi tiếng thế giới từ năm 2009 đến 2011</li><li>2005: Tái tung thương hiệu và phát triển nhãn hàng cao cấp từ năm 2005 đến 2008</li><li>2001: Đẩy mạnh xây dựng thương hiệu và thực hiện cổ phần hóa từ 2001 đến 2004</li><li>1993: Tăng tốc mở rộng mang lưới và ngành nghề từ năm 1993 đến 2000</li><li>1988: Hình thành và xác định chiến lược phát triển từ năm 1988 đến 1992</li></ul>', 50, '2024-09-29 00:50:27', '2024-11-12 06:57:11'),
(5066, 1, 1, 'CÔNG TY TNHH PIAGGIO VIỆT NAM', 'cong-ty-tnhh-piaggio-viet-nam', 'company-images/01JCFJPFMNP785YEGWQCEZZBNB.jpg', 'image_public_id', 'company-cover-images/01JCFJPFMQV7JDYFZCG545T6BB.jpg', 'cover_image_public_id', 'fb-link', 'yt-link', 'ln-link', 'example@co.com', '123456845', 'https://piaggio.com', '2500288968', '2024-11-10', '7', 'Sample description', 50, '2024-09-29 00:50:27', '2024-11-12 06:59:08'),
(5067, 1, 1, 'NGÂN HÀNG THƯƠNG MẠI CỔ PHẦN NAM Á', 'ngan-hang-thuong-mai-co-phan-nam-a', 'company-images/01JCFJT3YZ1XDPE6HP6Z75A9Q9.png', 'image_public_id', 'company-cover-images/01JCFJT3Z1QCZ8DPZ0W7Z40M3S.png', 'cover_image_public_id', 'fb-link', 'yt-link', 'ln-link', 'example@co.com', '123456846', 'https://www.namabank.com.vn', '300872315', '2024-11-11', '7', '<h2>Giới thiệu công ty</h2><p>Công ty Cổ phần Điện Lực Đông Nam Á là một đơn vị hoạt động trong lĩnh vực cung cấp giải pháp điện năng, thiết kế và thi công các công trình điện. Cùng với việc chuyên cung cấp các thiết bị như tủ trung thế, tủ hạ thế và máy biến áp, công ty cũng mạnh dạn nhận thầu các dự án điện năng lượng mặt trời, thể hiện sự đa dạng trong lĩnh vực hoạt động. Công ty cam kết mang đến cho khách hàng những sản phẩm chất lượng, với mục tiêu xây dựng một doanh nghiệp có hệ thống quản trị hiệu quả và hiện đại.<br><br>Với phương châm “AN TOÀN - CHẤT LƯỢNG - TIẾN ĐỘ”, Công ty Cổ phần Điện Lực Đông Nam Á luôn đặt sự an toàn và chất lượng sản phẩm lên hàng đầu. Công ty chú trọng đến việc xây dựng một đội ngũ cán bộ có tư duy sáng tạo và trách nhiệm, tham gia tích cực vào từng giai đoạn của dự án. Sự nghiêm túc và rõ ràng trong công việc không chỉ giúp công ty thực hiện các dự án một cách hiệu quả mà còn tạo dựng niềm tin vững chắc từ phía khách hàng.<br><br>Công ty cũng không ngừng nỗ lực cải tiến và sáng tạo để đáp ứng nhu cầu ngày càng cao của thị trường. Với kinh nghiệm nhiều năm hoạt động, Công ty Cổ phần Điện Lực Đông Nam Á đã thực hiện nhiều dự án được khách hàng đánh giá cao. Công ty đang hướng tới việc duy trì và mở rộng những dự án thành công trong tương lai, đồng thời đảm bảo tiêu chuẩn chất lượng theo quy định của ISO 9001:2015.</p><h2>Các hoạt động ngoại khóa</h2><ul><li>Du lịch</li><li>Thể thao</li></ul><p><br></p>', 10, '2024-09-29 00:50:27', '2024-11-12 07:01:07'),
(5068, 1, 1, 'Công Ty TNHH Bảo Hiểm Nhân Thọ Dai-Ichi Việt Nam', 'cong-ty-tnhh-bao-hiem-nhan-tho-dai-ichi-viet-nam', 'company-images/01JCFJW5TD6BAW1EMK7D46N947.jpg', 'image_public_id', 'company-cover-images/01JCFJW5TFW9H0M2TK5MHT6M2X.jpg', 'cover_image_public_id', 'fb-link', 'yt-link', 'ln-link', 'example@co.com', '123456847', 'https://example.com', '301851276', '2024-11-12', '3', '<h2>Giới thiệu công ty</h2><p>Mã số thuế 0301851276<br>Địa chỉ 149-151 Nguyễn Văn Trỗi, Phường 11, Quận Phú Nhuận, TP Hồ Chí Minh<br>Người đại diện Đặng Hồng Hải<br>Ngoài ra Đặng Hồng Hải còn đại diện các doanh nghiệp:<br>CTY TNHH BẢO HIỂM NHÂN THỌ DAI-ICHI VIỆT NAM(NTNN)</p><p>on</p>', 1000, '2024-09-29 00:50:27', '2024-11-12 07:02:14'),
(5069, 1, 1, 'CÔNG TY CỔ PHẦN CHỨNG KHOÁN VNDIRECT', 'cong-ty-co-phan-chung-khoan-vndirect', 'company-images/01JCFJY6V4AK6M43MS3M4GR0SA.jpg', 'image_public_id', 'company-cover-images/01JCFJY6V8TF06S68Y26NPGQ9J.jpg', 'cover_image_public_id', 'fb-link', 'yt-link', 'ln-link', 'example@co.com', '123456848', 'https://vndirect.com.vn', '102065366', '2024-11-13', '26', '<p>Công Ty Cổ Phần Chứng Khoán Vndirect - Chi Nhánh HCM là một trong những công ty chứng khoán hàng đầu tại Việt Nam, cung cấp dịch vụ tài chính toàn diện từ giao dịch cổ phiếu, chứng quyền, đến giao dịch ký quỹ. Với nền tảng công nghệ tiên tiến, Vndirect sở hữu nền tảng giao dịch chuyên biệt VNDSTOCK, cho phép khách hàng thực hiện các giao dịch một cách hiệu quả. Ngoài ra, công ty còn cung cấp dịch vụ đầu tư đa dạng, giúp nhà đầu tư tối ưu hóa chiến lược đầu tư cá nhân.<br><br>Công ty cũng chú trọng đến việc cung cấp kiến thức đầu tư từ cơ bản đến nâng cao cho các khách hàng, với nhiều khóa đào tạo và nguồn tài liệu phong phú. Bên cạnh đó, dịch vụ My DGO và DGO COMPASS là những công cụ hỗ trợ giúp người dùng quản lý tài sản cá nhân và đưa ra quyết định đầu tư thông minh hơn. Vndirect cam kết đồng hành cùng nhà đầu tư trên con đường đến sự bảo an tài chính và sức khỏe đầu tư bền vững.<br><br>Sở hữu đội ngũ lãnh đạo giàu kinh nghiệm và tận tâm, Vndirect luôn hướng tới việc cải thiện dịch vụ và nâng cao trải nghiệm của khách hàng. Công ty cũng chú trọng đến việc công khai thông tin tài chính và quản trị doanh nghiệp minh bạch, nhằm tạo dựng niềm tin và sự tín nhiệm với cổ đông và nhà đầu tư. Với tầm nhìn rõ ràng về phát triển bền vững, Công Ty Cổ Phần Chứng Khoán Vndirect - Chi Nhánh HCM không ngừng mở rộng các dịch vụ và sản phẩm để đáp ứng nhu cầu đa dạng của thị trường.</p>', 500, '2024-09-29 00:50:27', '2024-11-12 07:03:21'),
(5070, 29, 1, 'NGÂN HÀNG THƯƠNG MẠI CỔ PHẦN SÀI GÒN - HÀ NỘI', 'ngan-hang-thuong-mai-co-phan-sai-gon---ha-noi', 'company-images/01JCFK0ABDKQP7DGC03K1WJDJH.jpg', 'image_public_id', 'company-cover-images/01JCFK0ABFFABZ3PEAS165S7SC.jpg', 'cover_image_public_id', 'fb-link', 'yt-link', 'ln-link', 'example@co.com', '123456849', 'https://www.shb.com.vn', '1800278630', '2024-11-14', '7', '<p>ên quốc tế SHBANK FINANCE COMPANY LIMITED<br>Tên viết tắt SHB FC LTD<br>Mã số thuế 0107779290<br>Địa chỉ Tòa nhà Gelex Số 52 Lê Đại Hành, Phường Lê Đại Hành, Quận Hai Bà Trưng, Hà Nội<br>Người đại diện Khlon Olena<br>Điện thoại Bị ẩn theo yêu cầu người dùng<br>Ngày hoạt động 2017-03-28<br>Quản lý bởi Cục Thuế Thành phố Hà Nội<br>Loại hình DN Công ty trách nhiệm hữu hạn 2 thành viên trở lên ngoài NN<br>Tình trạng Đang hoạt động (đã được cấp GCN ĐKT)</p>', 100, '2024-09-29 00:50:27', '2024-11-12 07:04:36'),
(5071, 1, 1, 'TỔNG CÔNG TY ĐẦU TƯ VÀ KINH DOANH VỐN NHÀ NƯỚC - CÔNG TY TNHH', 'tong-cong-ty-dau-tu-va-kinh-doanh-von-nha-nuoc---cong-ty-tnhh', 'company-images/01JCFK3J202Z0BJ3FHYQ2ERCCV.jpg', 'image_public_id', 'company-cover-images/01JCFK3J2223J24FCYNQS6A3VD.jpg', 'cover_image_public_id', 'fb-link', 'yt-link', 'ln-link', 'example@co.com', '123456850', 'https://scicinvest.vn', '101992921', '2024-11-15', '8', '<h2>Giới thiệu công ty</h2><p>Công Ty TNHH Một Thành Viên Đầu Tư SCIC là một đơn vị hoạt động đầu tư tại Việt Nam, công ty chuyên về quản lý và đầu tư tài chính. SCIC tham gia vào việc tư vấn đầu tư, cung cấp dịch vụ M&amp;A (Mua bán và Sáp nhập) và tư vấn quản lý. Với một đội ngũ chuyên nghiệp, công ty hướng đến việc tối ưu hóa lợi ích cho các dự án của mình thông qua những phân tích và chiến lược đầu tư bài bản.<br><br>Công ty được thành lập với mục tiêu phát triển bền vững trong lĩnh vực đầu tư, SCIC cam kết thực hiện các dự án đầu tư theo tiêu chuẩn quốc tế và phù hợp với xu hướng phát triển kinh tế thị trường. Nhiệm vụ của SCIC bao gồm việc tìm kiếm cơ hội đầu tư, đánh giá hiệu quả tài chính và quản lý rủi ro để đảm bảo rằng các quyết định đầu tư đều có cơ sở vững chắc. Đồng thời, công ty cũng chú trọng đến việc công khai thông tin hoạt động, báo cáo tài chính hàng năm và các kế hoạch phát triển dài hạn.<br><br>Nhằm nâng cao năng lực cạnh tranh, SCIC luôn hướng đến việc đổi mới sáng tạo và tăng cường hợp tác với các đối tác chiến lược trong và ngoài nước. Công ty cũng chú trọng đến việc phát triển nguồn nhân lực, nâng cao trình độ quản trị doanh nghiệp nhằm đáp ứng tốt nhất nhu cầu của thị trường. Qua việc thực hiện những mục tiêu này, SCIC khẳng định được vị thế của mình trong lĩnh vực đầu tư tài chính tại Việt Nam.</p><h2>Các hoạt động ngoại khóa</h2><ul><li>Du lịch</li><li>Team building</li><li>Party</li></ul><p><br></p>', 1000, '2024-09-29 00:50:27', '2024-11-12 07:06:16'),
(5072, 1, 1, 'NGÂN HÀNG THƯƠNG MẠI CỔ PHẦN AN BÌNH (TÊN CŨ: NGÂN HÀNG THƯƠNG MẠI CỔ PHẦN NÔNG THÔN AN BÌNH)', 'ngan-hang-thuong-mai-co-phan-an-binh-ten-cu:-ngan-hang-thuong-mai-co-phan-nong-thon-an-binh)', 'company-images/01JCFK7MRNHJC7606S370BGQK8.png', 'image_public_id', 'company-cover-images/01JCFK7MRQNC5BXHVDKV0NZH27.jpg', 'cover_image_public_id', 'fb-link', 'yt-link', 'ln-link', 'example@co.com', '123456851', 'https://www.abbank.vn', '301412222', '2024-11-16', '7', '<p>Được thành lập từ năm 1993, cho đến nay Ngân hàng TMCP An Bình (ABBANK) đã và đang đóng góp cho thị trường tài chính Việt Nam một thương hiệu Ngân hàng bán lẻ thân thiện, uy tín và hiệu quả.<br><br>Cùng với sự phát triển uy tín thương hiệu, chất lượng môi trường làm việc tại ABBANK cũng liên tục được các tổ chức uy tín trong và ngoài nước đánh giá cao những năm gần đây: Năm 2021, ABBANK lọt vào danh sách 25 Thương hiệu Tài chính dẫn đầu tại Việt Nam theo công bố của Tạp chí Tài chính Forbes Việt Nam với giá trị thương hiệu ước đạt 39,4 triệu USD; ABBANK là 1 trong 10 ngân hàng ngoài quốc doanh có Chỉ số thương hiệu tốt nhất và Top 13 Ngân hàng có chỉ số thương hiệu tốt nhất (Theo báo cáo xếp hạng của Mibrand năm 2021); ABBANK cũng được tạp chí HR Asia chứng nhận là một trong những Nơi làm việc tốt nhất Châu Á kể từ năm 2020.<br><br>Với nguồn lực tài chính vững mạnh, các đối tác chiến lược là các định chế tài chính lớn, các tập đoàn uy tín trên Thế giới và Việt Nam như Tổ chức Tài chính Quốc tế (IFC), Ngân hàng Malaysia – Maybank, Tập đoàn Geleximco – Công ty Cổ phần; ABBANK cũng không ngừng hoàn thiện hệ thống, nâng cao chất lượng quản trị và vận hành theo thông lệ quốc tế..<br><br>Theo đuổi mục tiêu gia nhập nhóm ngân hàng cung cấp các sản phẩm dịch vụ ngân hàng số hàng đầu tại thị trường Việt Nam, ABBANK hiện đang mở rộng đầu tư vào lĩnh vực chuyển đổi số nhằm mang đến những trải nghiệm tối ưu nhất cho khách hàng.<br><br>Ở cột mốc 30 năm thành lập, ABBANK sở hữu một nền tảng công nghệ thông tin hiện đại; đội ngũ nhân sự tâm huyết và am hiểu nghiệp vụ, cùng với đó là hệ thống sản phẩm dịch vụ giải pháp tài chính tiện ích, hiệu quả và linh hoạt với mạng lưới điểm giao dịch rộng khắp trên toàn quốc nhằm phục vụ phương châm “Khách hàng là trọng tâm”.</p><h2>Chính sách bảo hiểm</h2><ul><li>Được hưởng bảo hiểm sức khỏe.</li><li>Được hưởng bảo hiểm xã hội.</li><li>01 NHÂN SỰ LÀ TÀI SẢN Chiến lược Nhân sự của ABBANK xác định lấy CBNV làm trọng tâm cho mọi hoạt động, hướng đến mục tiêu nâng cao năng lực tổ chức, đáp ứng nguồn nhân sự chất lượng cao để thực hiện kế hoạch tăng trưởng kinh doanh có hiệu quả, hiện thực hóa tầm nhìn đưa ABBANK trở thành một trong những NHTMCP hàng đầu Việt Nam, tập trung vào lĩnh vực bán lẻ. Với ABBANK, mỗi nhân sự là một tài sản quý giá, nhân sự có chất lượng cao sẽ tạo ra lợi thế cạnh tranh và thành công bứt phá cho tổ chức. 02 PHÁT TRIỂN - GẮN KẾT – TRÁCH NHIỆM Mỗi nhân sự là một mảnh ghép quan trọng tạo nên tập thể ABBANK vững vàng. ABBANK tổ chức các hoạt động đào tạo, bồi dưỡng nghiệp vụ thường xuyên cho CBNV và các chương trình phát triển đội ngũ cán bộ tiềm năng cho vị trí quản lý kế cận. Từ đó hướng đến việc phát triển đội ngũ CBNV trên tinh thần gắn kết, làm việc có trách nhiệm, tôn trọng kỷ luật và khuyến khích tinh thần sáng tạo nhằm đóng góp cho sự phát triển chung của Ngân hàng, đặc biệt trong giai đoạn thực hiện chiến lược đầu tư về công nghệ để chuyển đổi thành Ngân hàng số hàng đầu Việt Nam. 03 ĐÃI NGỘ CẠNH TRANH ABBANK áp dụng chính sách đãi ngộ theo năng lực và hiệu suất công việc cùng lộ trình công danh luôn rộng mở. Môi trường làm việc năng động, hiện đại, thân thiện, được đầu tư với mong muốn mang đến những giá trị gia tăng cho CBNV khi lựa chọn cống hiến tại Ngân hàng.</li></ul><h2>Các hoạt động ngoại khóa</h2><ul><li>Bóng đá</li><li>Du lịch</li><li>Team building</li></ul><h2>Lịch sử thành lập</h2><ul><li>2008: ABBANK ký kết hợp tác chiến lược với Maybank – Ngân hàng lớn nhất Malaysia; ABBANK được trao giải \"Ngân hàng thanh toán quốc tế xuất sắc 2007\" do Wachoviabank – một trong bốn ngân hàng lớn nhất của Mỹ trao tặng</li><li>2008: ABBANK phát triển và trưởng thành, đã có sự bứt phá mạnh mẽ về lượng từ năm 2008 đến nay</li><li>2007: ABBANK ký hợp đồng liên kết chiến lược với Agribank; trở thành thành viên của mạng thanh toán PAYNET; tăng vốn điều lệ lên 2300 tỷ đồng</li><li>2006: ABBANK đã phát hành công trái phiếu của EVN cùng với ngân hàng Deustch Bank và quỹ đầu tư Vina Capital</li><li>2005: Tập đoàn điện lực Việt Nam (EVN) trở thành cổ đông chiến lược của ABBANK</li><li>2004: Nâng cấp thành ngân hàng quy mô đô thị có vốn điều lệ 70,04 tỷ đồng</li><li>1993: Ngân hàng TMCP An Bình (ABBANK) được thành lập theo giấy phép số 535/GP-UB</li></ul>', 50, '2024-09-29 00:50:27', '2024-11-12 07:08:30'),
