(5077, 40, 1, 'CÔNG TY TNHH LIÊN DOANH THÀNH PHỐ ĐẾ VƯƠNG', 'cong-ty-tnhh-lien-doanh-thanh-pho-de-vuong', 'company-images/01JCFKMFKN18VTX5RMCHS808PW.png', 'image_public_id', 'company-cover-images/01JCFKMFKQVHP5HGAH93RSBSBT.png', 'cover_image_public_id', 'fb-link', 'yt-link', 'ln-link', 'example@co.com', '123456856', 'https://example.com', '313329515', '2024-11-21', '12', '<p>&nbsp;Giới thiệu công ty</p><p>Mã số thuế 1100491064<br>Địa chỉ Số 58A, Quốc Lộ 1A, Xã Mỹ Yên, Huyện Bến Lức, Tỉnh Long An, Việt Nam<br>Người đại diện CHOU, MING-CHENG<br>Ngoài ra CHOU, MING-CHENG còn đại diện các doanh nghiệp:<br>CÔNG TY TNHH EVERTRADE VIỆT NAM<br>CÔNG TY TNHH LẠI HỒNG<br>CÔNG TY TNHH FORTUNE TRIAD<br>Điện thoại 072 3890423<br>Ngày hoạt động 2008-05-06<br>Quản lý bởi Cục Thuế Tỉnh Long An<br>Loại hình DN Công ty trách nhiệm hữu hạn ngoài NN<br>Tình trạng Đang hoạt động (đã được cấp GCN ĐKT)&nbsp;</p>', 100, '2024-09-29 00:50:27', '2024-11-12 07:15:31'),
(5078, 1, 1, 'CÔNG TY TNHH MẶT TRỜI PHÚ QUỐC', 'cong-ty-tnhh-mat-troi-phu-quoc', 'company-images/01JCFKPQJTWBMTQ46BMY8C46QR.jpg', 'image_public_id', 'company-cover-images/01JCFKPQJWQN29PX50B0JT2N7M.jpg', 'cover_image_public_id', 'fb-link', 'yt-link', 'ln-link', 'example@co.com', '123456857', 'https://premiervillage-phuquoc.com', '1701900730', '2024-11-22', '18', '<p>Công ty TNHH Mặt Trời Phú Quốc điều hành khu nghỉ dưỡng Premier Village Phú Quốc, một điểm đến lý tưởng cho những ai tìm kiếm không gian nghỉ ngơi và thư giãn tại Đảo Ngọc. Nằm tại Mũi Ông Đội, khu nghỉ dưỡng được bao bọc bởi hai mặt biển, mang đến tầm nhìn tuyệt đẹp ra biển cả và khung cảnh thiên nhiên hữu tình. Premier Village Phú Quốc nổi bật với 215 biệt thự sang trọng, mỗi biệt thự đều được trang bị bể bơi riêng. Không gian nghỉ dưỡng không chỉ là lựa chọn lý tưởng cho gia đình, mà còn phù hợp cho các cặp đôi và nhóm bạn.<br><br>Khu nghỉ dưỡng cung cấp nhiều dịch vụ chăm sóc sức khỏe và giải trí bao gồm Plumeria Spa, nơi du khách có thể thư giãn và phục hồi năng lượng giữa khung cảnh thiên nhiên. Bên cạnh đó, các cơ sở thể thao như phòng gym và yoga cũng được đầu tư bài bản, tạo điều kiện thuận lợi cho việc rèn luyện sức khỏe. Bể bơi chung nhiều tầng nối liền hai bờ biển là một trong những điểm nhấn đặc biệt, mang lại những trải nghiệm độc đáo cho du khách trong suốt kỳ nghỉ.<br><br>Ngoài hệ thống tiện ích đa dạng, Premier Village Phú Quốc còn sở hữu các nhà hàng nổi bật với thực đơn phong phú. Du khách có thể thưởng thức những món ăn truyền thống Việt Nam tại nhà hàng theMarket, hoặc đắm chìm trong các món nướng độc đáo tại nhà hàng Corallo. Với tất cả những gì mà khu nghỉ dưỡng mang lại, Premier Village Phú Quốc hứa hẹn là một điểm đến không thể bỏ qua cho những ai yêu thích sự sang trọng và thiên nhiên.</p>', 100, '2024-09-29 00:50:27', '2024-11-12 07:16:44'),
(5079, 1, 1, 'CÔNG TY TRÁCH NHIỆM HỮU HẠN YKK VIỆT NAM', 'cong-ty-trach-nhiem-huu-han-ykk-viet-nam', 'company-images/01JCFKS7FM9169B1MTCP10R126.jpg', 'image_public_id', 'company-cover-images/01JCFKS7FPG6K81ZYYB6EDTG0P.jpg', 'cover_image_public_id', 'fb-link', 'yt-link', 'ln-link', 'example@co.com', '123456858', 'https://ykk.com.vn', '3600255100', '2024-11-23', '9', '<h2>Giới thiệu công ty</h2><p>YKK Vietnam was established in 1998, as the 10th Fastening Company in the ASAO (Asean South Asia &amp; Oceania) Region. With the assistance of its valued customers, business partners and employees, we have been expanding our business and we believe that we are able to contribute further to the development to Garment, Shoes, and Luggage Industries in Vietnam.<br>In order for us to respond to our customers needs speedily and accurately we have been focusing on these 4 areas in the past years. First is to strengthen marketing to meet the global needs of our customers. Second is to increase production capacity and to renew production lines to increase productivity. Third to improve information systems to quickly respond to the market changes and for analyzing business strategies. The fourth is to strive towards world class standards, towards which we achieved ISO9001:2000, ISO 14001:1996 and Oeko-tex certification.<br>We still need to make improvements to re-align our organization and to reinforce our structure in order to improve customer\'s satisfaction. We will continue to upgrade our quality and improve our service, so we would like to ask for your continued support towards YKK Vietnam and YKK Products.</p><h2>Các hoạt động ngoại khóa</h2><ul><li>Du lịch</li><li>Thể thao</li></ul><p><br></p>', 50, '2024-09-29 00:50:27', '2024-11-12 07:18:06'),
(5080, 1, 1, 'CÔNG TY TNHH EXPEDITORS VIỆT NAM', 'cong-ty-tnhh-expeditors-viet-nam', 'company-images/01JCFKV7XYWSBYAJDPRKK9VDQE.jpg', 'image_public_id', 'company-cover-images/01JCFKV7Y0GDW3SVBNGAMV0N9Q.jpg', 'cover_image_public_id', 'fb-link', 'yt-link', 'ln-link', 'example@co.com', '123456859', 'https://expeditors.com', '312545104', '2024-11-24', '14', '<p>Công Ty TNHH Expeditors Việt Nam là một công ty cung cấp dịch vụ logistics và chuỗi cung ứng hàng đầu, chuyên cung cấp các giải pháp tiên tiến với sự kết hợp giữa công nghệ và dịch vụ khách hàng xuất sắc. Công ty hoạt động trong nhiều lĩnh vực bao gồm ô tô, hàng không, sức khỏe, sản xuất và bán lẻ, với mục tiêu nâng cao hiệu quả logistic cho khách hàng thông qua việc áp dụng các giải pháp công nghệ hiện đại và hệ thống phần mềm tiên tiến.<br><br>Expeditors Việt Nam cung cấp một loạt các dịch vụ từ quản lý chuỗi cung ứng, vận chuyển hàng không, đường biển và đường bộ đến xử lý thủ tục hải quan và quản lý rủi ro. Bên cạnh đó, công ty cũng cung cấp các dịch vụ như quản lý container tổng thể và các chương trình phân phối chuyên biệt, giúp tối ưu hóa quy trình logistics cho khách hàng trong từng ngành nghề cụ thể. Cam kết của công ty là cung cấp các giải pháp toàn diện, an toàn và hiệu quả nhằm đáp ứng nhu cầu đa dạng của thị trường.<br><br>Ngoài ra, Expeditors còn chú trọng đến việc phát triển công nghệ và cơ sở hạ tầng bảo mật nhằm nâng cao khả năng tích hợp dữ liệu và cung cấp thông tin minh bạch cho khách hàng. Với đội ngũ lãnh đạo có kinh nghiệm và văn hóa công ty hướng đến sự bền vững, Expeditors cam kết không ngừng cải tiến dịch vụ và đem lại giá trị lâu dài cho các đối tác và khách hàng của mình.</p><h2>Chính sách bảo hiểm</h2><ul><li>Được hưởng bảo hiểm sức khỏe.</li><li>Được hưởng bảo hiểm xã hội.</li></ul>', 50, '2024-09-29 00:50:27', '2024-11-12 07:20:13'),
(5081, 1, 1, 'CÔNG TY TNHH MỘT THÀNH VIÊN XỔ SỐ KIẾN THIẾT THÀNH PHỐ HỒ CHÍ MINH', 'cong-ty-tnhh-mot-thanh-vien-xo-so-kien-thiet-thanh-pho-ho-chi-minh', 'company-images/01JCFM1RZW7WB1XZST9WYWT0YV.png', 'image_public_id', 'company-cover-images/01JCFM1RZZV853RDDQX88QB81C.png', 'cover_image_public_id', 'fb-link', 'yt-link', 'ln-link', 'example@co.com', '123456860', 'https://www.xskthcm.com/', '300507182', '2024-11-25', '3', '<p>Cách đây 45 năm, vào ngày 07/3/1978 Ban điều hành Xổ số kiến thiết thành phố Cần Thơ ra đời theo Quyết định số 201/UBTP/78 của Ủy ban nhân dân thành phố Cần Thơ. Ngay những năm đầu thành lập, với mục tiêu “Ích nước - Lợi nhà”, nguồn thu từ hoạt động xổ số kiến thiết dùng để đầu tư phát triển, xây dựng các công trình giáo dục, y tế và phúc lợi công cộng nhằm phục vụ ngày càng tốt hơn đời sống vật chất và tinh thần cho người dân. Bên cạnh đó, hoạt động xổ số kiến thiết còn góp phần ổn định kinh tế - xã hội của địa phương thông qua việc tạo công ăn việc làm và thu nhập ổn định cho hàng chục ngàn lao động ở thành thị và nông thôn, phục vụ nhu cầu giải trí lành mạnh cho người dân.<br><br>Ngày 07/3/2023 - một cột mốc đáng nhớ để Công ty trách nhiệm hữu hạn Nhà nước một thành viên Xổ số kiến thiết Cần Thơ khẳng định một hành trình, một tên tuổi, nền móng vững chắc để vươn xa hơn trong quá trình hội nhập quốc tế.</p>', 100, '2024-09-29 00:50:27', '2024-11-12 07:22:46'),
(5082, 1, 1, 'CÔNG TY TNHH ĐIỆN STANLEY VIỆT NAM', 'cong-ty-tnhh-dien-stanley-viet-nam', 'company-images/01JCFM60KP40VR9GHBDKN2KRJ1.jpg', 'image_public_id', 'company-cover-images/01JCFM60KSFC3TJAW34AR5BNH6.jpg', 'cover_image_public_id', 'fb-link', 'yt-link', 'ln-link', 'example@co.com', '123456861', 'https://stanley-ledlighting.com/', '100114515', '2024-11-26', '22', '<p>SampCông ty TNHH Điện Stanley Việt Nam là công ty liên doanh với Nhật Bản, Thái Lan chuyên sản xuất các loại đèn, linh kiện điện tử cho ô tô, xe máy. Trải qua 22 năm hình thành và phát triển, Stanley Việt Nam đã không ngừng lớn mạnh và trở thành một trong những Doanh nghiệp tiêu biểu của Việt Nam. Năm 2018 công ty đứng thứ 69 trong số 100 doanh nghiệp đóng thuế lớn nhất cả nước. Là một nhánh của thương hiệu nổi tiếng trên thế giới, Việt Nam Stanley tự hào khi mang lại cho khách hàng những sản phẩm chất lượng: thiết bị điện tử, thiết bị đèn chiếu sáng.le description</p>', 50, '2024-09-29 00:50:27', '2024-11-12 07:25:05'),
