(5419, 1, 1, 'Công ty TNHH Bảo hiểm nhân thọ MVI', 'cong-ty-tnhh-bao-hiem-nhan-tho-mvi', 'company-images/01JCF0BV7Q9XE8KW6X7QVQCCSF.jpg', 'image_public_id', 'company-cover-images/01JCF0BV7TNCB5QZHKFHD3SBBD.jpg', 'cover_image_public_id', 'fb-link', 'yt-link', 'ln-link', 'wecare@aviva.com.vn', '0105458164', 'https://www.mvilife.com.vn/', '105458164', '2025-10-29', '25', '<p>Aviva là tập đoàn bảo hiểm đến từ vương quốc Anh với 321 năm kinh nghiệm hoạt động trong lĩnh vực bảo hiểm và hiện đang là tập đoàn bảo hiểm lớn thứ năm thế giới với sự hiện diện tại 16 quốc gia. Tại Việt Nam, Aviva bắt đầu hoạt động trong lĩnh vực bảo hiểm nhân thọ từ năm 2011 với tiền thân là Công ty bảo hiểm nhân thọ Vietinbank Aviva - liên doanh giữa tập đoàn Aviva và VietinBank. Tháng 4/2017, tập đoàn Aviva chính thức hoàn tất việc mua lại 50% vốn góp của ngân hàng Vietinbank trong liên doanh và thành lập Aviva Việt Nam.</p>', 500, '2024-09-29 00:50:27', '2024-11-12 01:41:19'),
