(5986, 1, 1, 'CÔNG TY TNHH YOUNGONE BẮC GIANG', 'cong-ty-tnhh-youngone-bac-giang', 'company-images/01JCF002ADR2F24V6V89TDNGW5.jpg', 'image_public_id', 'company-cover-images/01JCF002AGC5E2GE1VVB59898R.jpg', 'cover_image_public_id', 'fb-link', 'yt-link', 'ln-link', 'example@co.com', '0204 3661 608', 'https://www.facebook.com/ybl.youngonevn', '2400598268', '2027-05-19', '24', '<p>Youngone là tập đoàn toàn cầu trong lĩnh vực may mặc, trang phục,..Với trụ sở chính tại Seoul, Hàn Quốc. Tập đoàn có có các nhà máy tại Bangladesh, Trung Quốc, Elsalvador và Việt Nam. Công ty Youngone Bắc Giang ( 100% vốn Hàn Quốc ) đặt tại Lô C14, C15, KCN Đình Trám, huyện Việt Yên, tỉnh Bắc Giang là thành viên của tập đoàn.</p><p>Đến với chúng tôi bạn sẽ có nhiều cơ hội, mức lương và chế độ phúc lợi hấp dẫn, môi trường làm việc thân thiện. Do nhu cầu mở rộng sản xuất, chúng tôi liên tục tuyển dụng.</p>', 500, '2024-09-29 00:50:28', '2024-11-12 01:34:22'),
